  `PAGAMENTO_AGENCIA` varchar(10) DEFAULT NULL,
  `PAGAMENTO_AGENCIA_DIGITO` char(1) DEFAULT NULL,
  `PAGAMENTO_CONTA` varchar(10) DEFAULT NULL,
  `PAGAMENTO_CONTA_DIGITO` char(1) DEFAULT NULL,
