  `PIS_NUMERO` varchar(12) DEFAULT NULL,
  `PIS_BANCO` varchar(10) DEFAULT NULL,
  `PIS_AGENCIA` varchar(10) DEFAULT NULL,
  `PIS_AGENCIA_DIGITO` char(1) DEFAULT NULL,
  `CTPS_NUMERO` varchar(10) DEFAULT NULL,
  `CTPS_SERIE` varchar(10) DEFAULT NULL,
  `CTPS_DATA_EXPEDICAO` date DEFAULT NULL,
  `CTPS_UF` char(2) DEFAULT NULL,
