  KEY `FK_TIPO_ADMISSAO_COLAB` (`ID_TIPO_ADMISSAO`),
  KEY `FK_SINDICATO_COLAB` (`ID_SINDICATO`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

