praticadas por optantes pelo Simples Nacional contempladas com imunidade do ICMS.'),(8,'400','Não tributada pelo Simples Nacional','Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional não sujeitas à tributação pelo ICMS dentro do Simples Nacional.'),(9,'500','ICMS cobrado anteriormente por substituição tributária (substituído) ou por antecipação','Classificam-se neste código as operações sujeitas exclusivamente ao regime de substituição tributária na condição de substituído tributário ou no caso de antecipações.'),(10,'900','Outros','Classificam-se neste código as demais operações que não se enquadrem nos códigos 101, 102, 103, 201, 202, 203, 300, 400 e 500.');

