),(225,'3.01.01.01.01.01.01','Receita de Exportação Direta de Mercadorias e Produtos','Contas que registram o valor da receita auferida em decorrência da exportação direta de mercadorias e produtos.','2008-01-01',NULL,'A'),(226,'3.01.01.01.01.01.02','Receita de Vendas de Mercadorias e Produtos a Comercial Exportadora com Fim Específico de Exportação','Contas que registram o valor da receita auferida em decorrência da venda de mercadorias e produtos a empresa comercial exportadora, com fim específico de exportação.','2008-01-01',NULL,'A'),(227,'3.01.01.01.01.01.03','Receita de Exportação de Serviços','Contas que registram o valor da receita auferida em decorrência da exportação direta de serviços','2008-01-01',NULL,'A'),(228,'3.01.01.01.01.02.00','Receita da Venda no Mercado Interno de Produtos de Fabricação Própria','Contas que registram a receita auferida no mercado interno correspondente à venda de produtos de fabricação própria e as receitas auferidas na industrialização por encomenda ou por conta e ordem de terceiros. (Não se incluem o valor correspondente ao Imposto sobre Produtos Industrializados (IPI) cobrado destacadamente do comprador ou contratante, uma vez que o vendedor é mero depositário e este imposto não integra o preço de venda da mercadoria, e, também, o valor correspondente ao ICMS cobrado na condição de substituto.)',NULL,NULL,'A'),(229,'3.01.01.01.01.03.00','Receita da Revenda de Mercadorias no Mercado Interno','Contas que registram receita auferida no mercado interno, correspondente à revenda de mercadorias e o resultado auferido nas operações de conta alheia.',NULL,NULL,'A'),(230,'3.01.01.01.01.04.00','Receita da Prestação de Serviços – Mercado Interno','Contas que registram a receita decorrente dos serviços prestados.',NULL,NULL,'A'),(231,'3.01.01.01.01.05.00','Receita das Unidades Imobiliárias Vendidas','As pessoas jurídicas que exploram atividades imobiliárias devem indicar, nestas contas, o montante das receitas das unidades imobiliárias vendidas, apropriadas ao resultado, inclusive as receitas transferidas de Resultados de Exercícios Futuros e os custos recuperados de períodos de apuração anteriores.',NULL,NULL,'A'),(232,'3.01.01.01.01.06.00','Receita de Locação de Bens Móveis e Imóveis','Contas que registram a receita decorrente da locação de bens móveis e imóveis',NULL,NULL,'A'),(233,'3.01.01.01.01.07.00','Outras','Outras contas que registrem valores componentes da receita bruta não especificadas nos itens anteriores.',NULL,NULL,'A'),(234,'3.01.01.01.03','DEDUÇÕES DA RECEITA BRUTA','',NULL,NULL,'S'),(235,'3.01.01.01.03.01.00','(-) Vendas Canceladas, Devoluções e Descontos Incondicionais','Contas representativas das vendas canceladas, a devoluções de vendas e a descontos incondicionais concedidos sobre  receitas constantes das contas integrantes do grupo RECEITA BRUTA',NULL,NULL,'A'),(236,'3.01.01.01.03.02.00','(-) ICMS','Contas que registram o total do Imposto Sobre Operações Relativas à Circulação de Mercadorias e Sobre Prestação de Serviços de Transporte Interestadual e Intermunicipal e de Comunicação (ICMS) calculado sobre as receitas das vendas e de serviços constantes das contas integrantes do grupo RECEITA BRUTA. Informar o resultado da aplicação das alíquotas sobre as respectivas receitas, e não o montante recolhido, durante o período de apuração, pela pessoa jurídica.O valor referente ao ICMS pago como substituto não deve ser incluído nesta conta.',NULL,NULL,'A'),(237,'3.01.01.01.03.03.00','(-) Cofins','vigente à época da ocorrência dos fatos geradores, incidente sobre as receitas das contas integrantes do grupo RECEITA BRUTA. O valor informado deve ser apurado de forma centralizada pelo estabelecimento matriz, quando a pessoa jurídica possuir mais de um estabelecimento (Lei no 9.779, de 1999, art. 15, III). Não incluir a Cofins incidente sobre as demais receitas operacionais, que deverá ser informada em conta distinta.',NULL,NULL,'A'),(238,'3.01.01.01.03.04.00','(-) PIS/Pasep','Contas que registram as contribuições para o PIS/Pasep apurado sobre a receita de vendas em consonância com a legislação vigente à época da ocorrência dos fatos geradores, incidente sobre as receitas das contas integrantes do grupo RECEITA BRUTA. O valor informado deve ser apurado de forma centralizada pelo estabelecimento matriz, quando a pessoa jurídica possuir mais de um estabelecimento (Lei no 9.779, de 1999, art. 15, III). Não incluir o PIS/Pasep incidente sobre as demais receitas operacionais, que deverá ser informada em conta distinta.',NULL,NULL,'A'),(239,'3.01.01.01.03.05.00','(-) ISS','Contas que registram o Imposto sobre Serviço de qualquer Natureza (ISS) relativo às receitas de serviços,conforme legislação específica.',NULL,NULL,'A'),(240,'3.01.01.01.03.06.00','(-) Demais Impostos e Contribuições Incidentes sobre Vendas e Serviços','Contas que registrem os demais impostos e contribuições incidentes sobre as receitas das vendas de que tratam as contas integrantes do grupo RECEITA BRUTA, que guardem proporcionalidade com o preço e sejam considerados redutores das receitas de vendas.',NULL,NULL,'A'),(241,'3.01.01.03','CUSTO DOS BENS E SERVIÇOS VENDIDOS','',NULL,NULL,'S'),(242,'3.01.01.03.01','CUSTO DOS PRODUTOS DE FABRICAÇÃO PRÓPRIA VENDIDOS','',NULL,NULL,'S'),(243,'3.01.01.03.01.00.00','Custo dos Produtos de Fabricação Própria Vendidos','','2008-01-01',NULL,'A'),(244,'3.01.01.03.01.01.00','Estoques no Início do Período de Apuração','Contas que registram os estoques de insumos, de produtos em elaboração e de produtos acabados existentes no início do período de apuração.',NULL,'0000-00-00','A'),(245,'3.01.01.03.01.02.00','Compras de Insumos à Vista','Contas que registram as aquisições à vista, durante o período de apuração, de matéria-prima, material secundário e material de embalagem, no mercado interno e externo, para utilização no processo produtivo, os valores referentes aos custos com transporte e seguro até o estabelecimento do contribuinte, os tributos não recuperáveis devidos na importação e o custo relativo ao desembaraço aduaneiro.',NULL,'0000-00-00','A'),(246,'3.01.01.03.01.03.00','Compras de Insumos a Prazo','Contas que registram as aquisições a prazo, durante o período de apuração, de matéria-prima, material secundário e material de embalagem, no mercado interno e externo, para utilização no processo produtivo, os valores referentes aos custos com transporte e seguro até o estabelecimento do contribuinte, os tributos não recuperáveis devidos na importação e o custo relativo ao desembaraço aduaneiro.',NULL,'0000-00-00','A'),(247,'3.01.01.03.01.04.00','Remuneração a Dirigentes de Indústria','Contas que registram: a) a remuneração mensal e fixa dos dirigentes diretamente ligados à produção, pelo valor total do custo incorrido no período de apuração, exceto os encargos sociais (Previdência Social e FGTS) que são informados em conta distinta; b) o valor relativo aos custos incorridos com salários indiretos concedidos pela empresa a administradores, diretores, gerentes e seus assessores, se ligados diretamente à produção (PN Cosit nº 11, de 30 de setembro de 1992). Atenção: deve ser incluído nesta conta o valor das gratificações dos dirigentes ligados à produção, inclusive o 13º salário.',NULL,'0000-00-00','A'),(248,'3.01.01.03.01.05.00','Custo do Pessoal Aplicado na Produção','Contas que representem do custo com ordenados, salários e outros custos com empregados ligados à produção da empresa, tais como: seguro de vida, contribuições ao plano PAIT, custos com programa de  previdência privada, contribuições para os Fundos de Aposentadoria Programada Individual (Fapi), e outras de caráter remuneratório.Inclusive os custos com supervisão direta, manutenção e guarda das instalações, decorrentes de vínculo empregatício com a pessoa jurídica.',NULL,'0000-00-00','A'),(249,'3.01.01.03.01.06.00','Encargos Sociais – Previdência Social','Contas que registram as contribuições para a Previdência Social (inclusive dos dirigentes de indústria - PN CST no 35, de 31 de agosto de 1981), relativas ao pessoal ligado diretamente à produção.',NULL,'0000-00-00','A'),(250,'3.01.01.03.01.07.00','Encargos Sociais – FGTS','Contas que registram as contribuições para o FGTS (inclusive dos dirigentes de indústria - PN CST no 35, de 31 de agosto de 1981), relativas ao pessoal ligado diretamente à produção.',NULL,'0000-00-00','A'),(251,'3.01.01.03.01.08.00','Encargos Sociais – Outros','Contas que registram encargos sociais, relativos ao pessoal ligado diretamente à produção, não classificados nas contas Encargos Sociais – Previdência Social e Encargos Sociais – FGTS .',NULL,'0000-00-00','A'),(252,'3.01.01.03.01.09.00','Alimentação do Trabalhador','Contas que registram os custos com alimentação do pessoal ligado diretamente à produção, realizados durante o período de apuração, ainda que a pessoa jurídica não tenha Programa de Alimentação do Trabalhador aprovado pelo Ministério do Trabalho.',NULL,'0000-00-00','A'),(253,'3.01.01.03.01.10.00','Manutenção e Reparo de Bens Aplicados na Produção','Contas que representam somente os custos realizados com reparos que não implicaram aumento superior a um ano da vida útil prevista no ato da aquisição do bem.',NULL,'0000-00-00','A'),(254,'3.01.01.03.01.11.00','Arrendamento Mercantil','Contas que representam o valor do custo incorrido a título de contraprestação de arrendamento mercantil de bens alocados na produção, segundo contratos celebrados com observância da Lei nº 6.099, de 12 de setembro de 1974, com as alterações da Lei nº 7.132, de 26 de outubro de 1983. Os custos com aluguel de outros bens alocados à produção, mediante contrato diferente do de arrendamento mercantil, devem ser indicados em \"Outros Custos\". Os valores referentes a bens que não sejam intrinsecamente relacionados com a produção devem ser informados na conta Arrendamento Mercantil do grupo DESPESAS OPERACIONAIS DAS ATIVIDADES EM GERAL.',NULL,'0000-00-00','A'),(255,'3.01.01.03.01.12.00','Encargos de Depreciação, Amortização e Exaustão','Contas que registram os encargos a esses títulos com bens aplicados diretamente na produção. Os encargos que não forem decorrentes de bens intrinsecamente relacionados com a produção devem ser informados na conta Encargos de Depreciação e Amortização do grupo DESPESAS OPERACIONAIS DAS ATIVIDADES EM GERAL.',NULL,'0000-00-00','A'),(256,'3.01.01.03.01.13.00','Constituição de Provisões','Contas que registram os encargos com a constituição de provisões que devam ser imputados aos custos de produção da empresa no período de apuração.',NULL,'0000-00-00','A'),(257,'3.01.01.03.01.14.00','Serviços Prestados por Pessoa Física sem Vínculo Empregatício','Contas que registram, salvo se houver conta mais específica neste plano referencial, os custos correspondentes aos serviços prestados à pessoa jurídica por pessoa física sem vínculo empregatício, relacionados com a atividade industrial da pessoa jurídica .',NULL,'0000-00-00','A'),(258,'3.01.01.03.01.15.00','Serviços Prestados Pessoa Jurídica','Contas que registram, salvo se houver conta mais específica neste plano referencial, os custos correspondentes aos serviços prestados por pessoa jurídica, relacionados com atividade industrial da pessoa jurídica declarante.',NULL,'0000-00-00','A'),(259,'3.01.01.03.01.16.00','Royalties e Assistência Técnica – PAÍS','Contas que registram as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no Brasil, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade industrial.',NULL,'0000-00-00','A'),(260,'3.01.01.03.01.17.00','Royalties e Assistência Técnica – EXTERIOR','Contas que registram as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no exterior, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade industrial.',NULL,'0000-00-00','A'),(261,'3.01.01.03.01.18.00','Outros Custos','Contas que representam os demais custos da empresa no processo de produção, para os quais não haja conta mais específica ou cujas classificações contábeis não se adaptem à nomenclatura específica, tais como: custo referente ao valor de bens de consumo eventual; as quebras ou perdas de estoque, e as ocorridas na fabricação, no transporte e manuseio.',NULL,'0000-00-00','A'),(262,'3.01.01.03.01.19.00','(-) Estoques no Final do Período de Apuração','Contas que representam o valor total dos estoques existentes no final do período de apuração, conforme a seguir: a) os estoques relativos aos insumos devem ser avaliados com exclusão dos impostos e contribuições recuperáveis, observadas as disposições da legislação pertinente; b) os estoques de produtos em elaboração devem ser avaliados com exclusão dos impostos e contribuições recuperáveis. O contribuinte que mantiver sistema de contabilidade de custo integrado e coordenado com o restante da escrituração pode utilizar os custos nele apurados para avaliação dos estoques de produtos em fabricação. Em caso negativo, tais estoques devem ser avaliados segundo o disposto no art. 296 do Decreto nº 3.000, de 1999, hipótese em que o valor de uma unidade em fabricação é avaliada: b.1) pela soma dos produtos obtidos mediante a multiplicação da quantidade de cada matéria-prima agregada por uma vez e meia o maior custo dessa matéria-prima no período de apuração; ou b.2) em 80% (oitenta por cento) do valor do produto acabado que tiver sido avaliado em 70% (setenta por cento) do maior preço de venda, sem exclusão do ICMS, no período de apuração. Os critérios de avaliação acima referidos devem ser observados na escrituração da empresa. c) os estoques de produtos acabados de fabricação própria devem ser inventariados no último dia do período de apuração. Se a empresa mantiver sistema de contabilidade de custo integrado e coordenado com o restante da escrituração pode utilizar os custos nele apurados para avaliação dos estoques de produtos acabados. Caso contrário, deverá observar, na contabilidade, a avaliação desses estoques tomando por base 70% (setenta por cento) do maior preço de venda do produto durante o período de apuração, sem exclusão do ICMS.',NULL,'0000-00-00','A'),(263,'3.01.01.03.03','CUSTO DAS MERCADORIAS REVENDIDAS','',NULL,NULL,'S'),(264,'3.01.01.03.03.00.00','Custo das Mercadorias Revendidas','','2008-01-01',NULL,'A'),(265,'3.01.01.03.03.01.00','Estoques no Início do Período de Apuração','Contas que registram os estoques de mercadorias para revenda existentes no início do período de apuração.',NULL,'0000-00-00','A'),(266,'3.01.01.03.03.02.00','Compras de Mercadorias à Vista','Contas que representam: a) o valor das mercadorias adquiridas à vista, no período de apuração, e destinadas à revenda; b) valor das mercadorias para revenda importadas do exterior pela própria pessoa jurídica. Quando for o caso, devem ser adicionados ao valor das compras de mercadorias os custos com transporte e seguro dessas mercadorias até o estabelecimento do contribuinte, os tributos não recuperáveis devidos na importação e o custo relativo ao desembaraço aduaneiro. Atenção: não devem ser informados os valores relativos a transferências de mercadorias entre matriz e filiais e entre filiais.',NULL,'0000-00-00','A'),(267,'3.01.01.03.03.03.00','Compras de Mercadorias a Prazo','Contas que representam: a) o valor das mercadorias adquiridas a prazo, no período de apuração, e destinadas à revenda; b) valor das mercadorias para revenda importadas do exterior pela própria pessoa jurídica. Quando for o caso, devem ser adicionados ao valor das compras de mercadorias os custos com transporte e seguro dessas mercadorias até o estabelecimento do contribuinte, os tributos não recuperáveis devidos na importação e o custo relativo ao desembaraço aduaneiro. Atenção: não devem ser informados os valores relativos a transferências de mercadorias entre matriz e filiais e entre filiais.',NULL,'0000-00-00','A'),(268,'3.01.01.03.03.04.00','(-) Estoques no Final do Período de Apuração','Contas que registram dos estoques de mercadorias para revenda existentes na data de encerramento do período de apuração.',NULL,'0000-00-00','A'),(269,'3.01.01.03.05','CUSTO DOS SERVIÇOS VENDIDOS','',NULL,'0000-00-00','S'),(270,'3.01.01.03.05.00.00','Custo dos Serviços Vendidos','','2008-01-01',NULL,'A'),(271,'3.01.01.03.05.01.00','Saldo Inicial de Serviços em Andamento','Contas que registram os serviços não acabados constante do balanço correspondente ao período de apuração imediatamente anterior.',NULL,'0000-00-00','A'),(272,'3.01.01.03.05.02.00','Material Aplicado na Produção dos Serviços','Contas correspondentes aos materiais aplicados diretamente na produção dos serviços durante o período de apuração.',NULL,'0000-00-00','A'),(273,'3.01.01.03.05.03.00','Remuneração de Dirigentes de Produção dos Serviços','Contas que registram: a) a remuneração mensal e fixa dos dirigentes diretamente ligados à produção dos serviços pelo valor total do custo incorrido no período de apuração, exceto os encargos sociais (Previdência Social e FGTS) que são informados em conta distinta; b) o valor relativo aos custos incorridos com salários indiretos concedidos pela empresa a administradores, diretores, gerentes e seus assessores, se ligados diretamente à produção (PN Cosit nº 11, de 30 de setembro de 1992). Atenção: deve ser incluído nesta conta o valor das gratificações dos dirigentes ligados à produção, inclusive o 13º salário.',NULL,'0000-00-00','A'),(274,'3.01.01.03.05.04.00','Custo do Pessoal Aplicado na Produção dos Serviços','Contas que registram os custos com mão-de-obra com vínculo empregatício aplicada diretamente na produção dos serviços.',NULL,'0000-00-00','A'),(275,'3.01.01.03.05.05.00','Serviços Prestados por Pessoa Física sem Vínculo Empregatício','Contas que registram, salvo se houver conta mais específica neste plano referencial, os custos correspondentes aos serviços prestados à pessoa jurídica por pessoa física sem vínculo empregatício, relacionados com a atividade de prestação de serviços da empresa.',NULL,'0000-00-00','A'),(276,'3.01.01.03.05.06.00','Serviços Prestados Pessoa Jurídica','Contas que registram, salvo se houver conta mais específica neste plano referencial, os custos correspondentes aos serviços prestados por pessoa jurídica à pessoa jurídica declarante, relacionados com sua atividade de prestação de serviços.',NULL,'0000-00-00','A'),(277,'3.01.01.03.05.07.00','Encargos Sociais – Previdência Social','Contas que registram as contribuições para a Previdência Social (inclusive dos dirigentes ligados à prestação dos serviços - PN CST no 35, de 31 de agosto de 1981), relativas ao pessoal ligado diretamente à produção dos serviços.',NULL,'0000-00-00','A'),(278,'3.01.01.03.05.08.00','Encargos Sociais – FGTS','Contas que registram as contribuições para o FGTS (inclusive dos dirigentes de empresa - PN CST no 35, de 31 de agosto de 1981), relativas ao pessoal ligado diretamente à produção dos serviços.',NULL,'0000-00-00','A'),(279,'3.01.01.03.05.09.00','Encargos Sociais – Outros','Contas que registram encargos sociais, relativos ao pessoal ligado diretamente à produção dos serviços, não classificados nas contas Encargos Sociais – Previdência Social e Encargos Sociais – FGTS.',NULL,'0000-00-00','A'),(280,'3.01.01.03.05.10.00','Alimentação do Trabalhador','Contas que registram os custos com alimentação do pessoal ligado diretamente à produção dos serviços, realizados durante o período de apuração, ainda que a pessoa jurídica não tenha Programa de Alimentação do Trabalhador aprovado pelo Ministério do Trabalho.',NULL,'0000-00-00','A'),(281,'3.01.01.03.05.11.00','Encargos de Depreciação e Amortização','Contas que registram os encargos a esses títulos com bens aplicados diretamente na produção dos serviços. Os encargos que não forem decorrentes de bens intrinsecamente relacionados com a produção devem ser informados na conta Encargos de Depreciação e Amortização do grupo DESPESAS OPERACIONAIS DAS ATIVIDADES EM GERAL.',NULL,'0000-00-00','A'),(282,'3.01.01.03.05.12.00','Arrendamento Mercantil','Contas que representam o valor do custo incorrido a título de contraprestação de arrendamento mercantil de bens alocados na produção dos serviços, segundo contratos celebrados com observância da Lei no 6.099, de 12 de setembro de 1974, com as alterações da Lei no 7.132, de 26 de outubro de 1983. Os custos com aluguel de outros bens alocados à produção, mediante contrato diferente do de arrendamento mercantil, devem ser indicados em \"Outros Custos\". Os valores referentes a bens que não sejam intrinsecamente relacionados com a produção devem ser informados na conta Arrendamento Mercantil do grupo DESPESAS OPERACIONAIS DAS ATIVIDADES EM GERAL.',NULL,'0000-00-00','A'),(283,'3.01.01.03.05.13.00','Constituição de Provisões','Contas que registram os encargos com a constituição de provisões que devam ser imputados aos custos de produção da empresa no período de apuração.',NULL,'0000-00-00','A'),(284,'3.01.01.03.05.14.00','Royalties e Assistência Técnica – PAÍS','Contas que registram  as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no Brasil, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade de prestação de serviços.',NULL,'0000-00-00','A'),(285,'3.01.01.03.05.15.00','Royalties e Assistência Técnica - EXTERIOR','Contas que registram as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliadas no exterior, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade de prestação de serviços.',NULL,'0000-00-00','A'),(286,'3.01.01.03.05.16.00','Outros Custos','Contas que representam os demais custos da empresa no processo de produção dos serviços, para os quais não haja conta mais específica ou cujas classificações contábeis não se adaptem à nomenclatura específica, tais como:custo referente ao valor de bens de consumo eventual; as quebras ou perdas de estoque, e as ocorridas na fabricação, no transporte e manuseio.',NULL,'0000-00-00','A'),(287,'3.01.01.03.05.17.00','(-) Saldo Final de Serviços em Andamento','Contas que representam os serviços não acabados e não faturados constantes do balanço correspondente ao período de apuração.',NULL,'0000-00-00','A'),(288,'3.01.01.03.07','CUSTO DAS UNIDADES IMOBILIÁRIAS VENDIDAS','',NULL,NULL,'S'),(289,'3.01.01.03.07.01.00','Custo das Unidades Imobiliárias Vendidas','Contas que registram, na empresa que tiver por objeto a compra de imóveis para venda ou que promover empreendimento de desmembramento ou loteamento de terrenos, incorporação imobiliária ou construção de prédio destinado à venda, os valores dos custos correspondentes às unidades imobiliárias vendidas apropriados ao resultado do período de apuração. A recuperação de custos do próprio período é computada no montante a ser indicado nesta conta. Os custos recuperados correspondentes a períodos de apuração anteriores devem ser indicados na conta Receita das Unidades Imobiliárias Vendidas.',NULL,NULL,'A'),(290,'3.01.01.03.09','AJUSTES DE ESTOQUES DECORRENTES DE ARBITRAMENTO','',NULL,NULL,'S'),(291,'3.01.01.03.09.01.00','Ajustes de Estoques Decorrentes de Arbitramento','Contas que, na pessoa jurídica submetida à apuração anual do imposto e que teve seu lucro arbitrado em um ou mais trimestres do ano-calendário, representam o  valor, positivo ou negativo, correspondente à diferença entre os estoques iniciais do período imediatamente subseqüente ao arbitramento e os estoques finais do período imediatamente anterior ao arbitramento. Caso haja arbitramento em mais de um trimestre do ano-calendário, não consecutivos, as contas devem representar a soma algébrica das diferenças apuradas em relação a cada período arbitrado.',NULL,'0000-00-00','A'),(292,'3.01.01.05','OUTRAS RECEITAS OPERACIONAIS','',NULL,NULL,'S'),(293,'3.01.01.05.01','OUTRAS RECEITAS OPERACIONAIS','',NULL,NULL,'S'),(294,'3.01.01.05.01.01.00','Variações Cambiais Ativas','Contas que registram os ganhos apurados em razão de variações ativas Decorrentes da atualização dos direitos de crédito e obrigações, calculados com base nas variações nas taxas de câmbio. Atenção: 1) As variações cambiais ativas decorrentes dos direitos de crédito e de obrigações, em função da taxa de câmbio, são consideradas como receita financeira, inclusive para fins de cálculo do lucro da exploração (Lei nº 9.718, art. 9º c/c art. 17); 2) Nas atividades de compra e venda, loteamento, incorporação e construção de imóveis, as variações cambiais ativas são reconhecidas como receita segundo as normas constantes da IN SRF nº 84/79, de 20 de dezembro de 1979, da IN SRF nº 23/83, de 25 de março de 1983, e da IN SRF nº 67/88, de 21 de abril de 1988 (IN SRF nº 25/99, de 25 de fevereiro de 1999).',NULL,NULL,'A'),(295,'3.01.01.05.01.02.00','Ganhos Auferidos no Mercado de Renda Variável, exceto Day-Trade','Contas que registram: a) o somatório dos ganhos auferidos, em cada mês do período de apuração, em operações realizadas nas bolsas de valores, de mercadorias, de futuros e assemelhadas, existentes no País; b) os ganhos auferidos nas alienações, fora de bolsa, de ouro, ativo financeiro, e de participações societárias, exceto as alienações de participações societárias permanentes em sociedades coligadas e controladas e de participações societárias que permanecerem no ativo da pessoa jurídica até o término do ano-calendário seguinte ao de suas aquisições; e c) os rendimentos auferidos em operações de swap e no resgate de quota de fundo de investimento cujas carteiras sejam constituídas, no mínimo, por 67% (sessenta e sete por cento) de ações no mercado à vista de bolsa de valores ou entidade assemelhada (Lei nº 9.532, de 1997, art. 28, alterado pela MP nº 1.636, de 1998, art. 2º, e reedições).Considera-se ganho o resultado positivo auferido nas operações citadas acima, realizadas em cada mês, admitida a dedução dos custos e despesas incorridos, necessários à realização das operações. Atenção: 1) Os ganhos auferidos em operações day-trade devem ser informados em conta específica. 2) O valor correspondente às perdas incorridas no mercado de renda variável, exceto day-trade, deve ser informado em conta específica. 3) São consideradas assemelhadas às bolsas de valores, de mercadorias e de futuros as entidades cujo objeto social seja  análogo ao das referidas bolsas e que funcionem sob a supervisão e fiscalização da Comissão de Valores Mobiliários (CVM).',NULL,NULL,'A'),(296,'3.01.01.05.01.03.00','Ganhos em Operações Day-Trade','Contas que registram os ganhos diários auferidos, em cada mês do período de apuração, em operações day-trade. Considera-se ganho o resultado positivo auferido nas operações citadas acima, realizadas em cada mês, admitida a dedução dos custos e despesas incorridos, necessários à realização das operações. Não se caracteriza como day-trade o exercício da opção e a venda ou compra do ativo no mercado à vista, no mesmo dia. Também não se caracterizam como day-trade as operações iniciadas por intermédio de uma instituição e encerradas em outra, quando houver a liquidação física mediante movimentação de títulos ou valores mobiliários em custódia. Atenção: o valor correspondente às perdas incorridas nas operações day-trade deve ser informado em conta específica.',NULL,NULL,'A'),(297,'3.01.01.05.01.04.00','Receitas de Juros sobre o Capital Próprio','Contas que registram os juros recebidos, a título de remuneração do capital próprio, em conformidade com o art. 9o da Lei no 9.249, de 1995. O valor informado deve corresponder ao total dos juros recebidos antes do desconto do imposto de renda na fonte. O valor do imposto de renda retido na fonte, para as pessoas jurídicas tributadas pelo lucro real, é considerado antecipação do imposto devido no encerramento do período de apuração ou, ainda, pode ser compensado com aquele que for retido, pela beneficiária, por ocasião do pagamento ou crédito de juros a título de remuneração do capital próprio, ao seu titular ou aos seus sócios.',NULL,NULL,'A'),(298,'3.01.01.05.01.05.00','Outras Receitas Financeiras','Contas que registram receitas auferidas no período de apuração relativas a juros, descontos, lucro na operação de reporte, prêmio de resgate de títulos ou debêntures e rendimento nominal auferido em aplicações financeiras de renda fixa, não incluídas nas contas precedentes deste  grupo. As receitas dessa natureza, derivadas de operações com títulos vencíveis após o encerramento do período de apuração, serão rateadas segundo o regime de competência.Atenção: 1) As variações monetárias ativas decorrentes da atualização dos direitos de crédito e das obrigações, em função de índices ou coeficientes aplicáveis por disposição legal ou contratual, devem ser informadas como receita financeira; 2) As variações cambiais ativas devem ser informadas na conta Variações Cambiais Ativas.',NULL,NULL,'A'),(299,'3.01.01.05.01.06.00','Ganhos na Alienação de Participações Não Integrantes do Ativo Permanente','Contas que registram os ganhos auferidos na alienação de ações, títulos ou quotas de capital não integrantes do ativo permanente, desde que não incluídos na conta Ganhos Auferidos no Mercado de Renda Variável, exceto Day-Trade.',NULL,NULL,'A'),(300,'3.01.01.05.01.07.00','Resultados Positivos em Participações Societárias','Contas que registram: a) os lucros e dividendos derivados de investimentos avaliados pelo custo de aquisição; b) os ganhos por ajustes no valor de investimentos relevantes avaliados pelo método da equivalência patrimonial, decorrentes de lucros apurados nas controladas e coligadas. Atenção: considera-se controlada a filial, a agência, a sucursal, a dependência ou o escritório de representação no exterior, sempre que os respectivos ativos e passivos não estejam incluídos na contabilidade da investidora, por força de normatização específica. c) as bonificações recebidas.  Atenção: 1) as bonificações recebidas, decorrentes da incorporação de lucros ou reservas não tributados na forma do art. 35 da Lei nº 7.713, de 1988, ou apurados nos anos-calendário de 1994 ou 1995, são consideradas a custo zero, não afetando o valor do investimento nem o resultado do período de apuração (art. 3º da Lei nº 8.849, de 1994, e art. 3º da Lei nº 9.064, de 1995). 2) o caso de investimento avaliado pelo custo de aquisição, as bonificações recebidas, decorrentes da incorporação de lucros ou reservas tributados na forma do art. 35 da Lei nº 7.713, de 1988, e de lucros ou reservas apurados no ano-calendário de 1993 ou a partir do ano-calendário de 1996, são registradas tomando-se como custo o valor da parcela dos lucros ou reservas capitalizados. d) os lucros e dividendos de participações societárias avaliadas pelo custo de aquisição; Atenção: os lucros ou dividendos recebidos em decorrência de participações societárias avaliadas pelo custo de aquisição adquiridas até 6 (seis) meses antes da data do recebimento devem ser registrados como diminuição do valor do custo, não sendo incluídos nesta conta. e) os resultados positivos decorrentes de participações societárias no exterior avaliadas pelo patrimônio líquido, os dividendos de participações avaliadas pelo custo de aquisição e os resultados de equivalência patrimonial relativos a filiais, sucursais ou agências da pessoa jurídica localizadas no exterior, em decorrência de operações realizadas naquelas filiais, sucursais ou agências. Os lucros auferidos no exterior serão adicionados ao lucro líquido, para efeito de determinação do lucro real, no período de apuração correspondente ao balanço levantado em 31 de dezembro do ano-calendário em que tiverem sido disponibilizados, observando-se o disposto nos arts. 394 e 395 do Decreto nº 3.000, de 1999, e no art. 74 da Medida Provisória nº 2.158-35, de 24 de agosto de 2001.',NULL,NULL,'A'),(301,'3.01.01.05.01.07.10','Amortização de Deságio nas Aquisições de Investimentos Avaliados pelo Patrimônio Líquido','Contas que registram as amortizações de deságios nas aquisições de investimentos avaliados pelo patrimônio líquido. O valor amortizado que for excluído do lucro líquido para determinação do lucro real deve ser controlado na Parte B do Livro de Apuração do Lucro Real até a alienação ou baixa da participação societária, quando, então, deve ser adicionado ao lucro líquido para determinação do lucro real no período de apuração em que for computado o ganho ou perda de capital havido.','2008-01-01',NULL,'A'),(302,'3.01.01.05.01.08.00','Resultados Positivos em SCP','Conta utilizada pelas pessoas jurídicas que forem sócias ostensivas de sociedades em conta de participação, para o registro: a) de lucros derivados de participação em SCP, avaliadas pelo custo de aquisição; b) dos ganhos por ajustes no valor de participação em SCP, avaliadas pelo método da equivalência patrimonial. Atenção: os lucros recebidos de investimento em SCP, avaliado pelo custo de aquisição, ou a contrapartida do ajuste do investimento ao valor do patrimônio líquido da SCP, no caso de investimento avaliado por esse método, podem ser excluídos na determinação do lucro real dos sócios, pessoas jurídicas, das referidas sociedades (Decreto nº 3.000, de 1999, art. 149).',NULL,NULL,'A'),(303,'3.01.01.05.01.09.00','Rendimentos e Ganhos de Capital Auferidos no Exterior','Contas que registram os rendimentos e ganhos de capital auferidos no exterior diretamente pela pessoa jurídica domiciliada no Brasil, pelos seus valores antes de descontado o tributo pago no país de origem. Esses valores podem, no caso de apuração trimestral do imposto, ser excluídos na apuração do lucro real do 1o ao 3o trimestres, devendo ser adicionados ao lucro líquido na apuração do lucro real referente ao 4º trimestre. Atenção: Os ganhos de capital referentes a alienações de bens e direitos do ativo permanente situados no exterior devem ser informados na conta Outras Receitas Não Operacionais..',NULL,NULL,'A'),(304,'3.01.01.05.01.10.00','Reversão dos Saldos das Provisões Operacionais','Contas que registram a reversão de saldos não utilizados das provisões constituídas no balanço do período de apuração imediatamente anterior para fins de apuração do lucro real (Lei no 9.430, de 1996, art. 14).',NULL,NULL,'A'),(305,'3.01.01.05.01.10.10','Prêmios Recebidos na Emissão de Debêntures','Contas que registram, a partir de 01.01.2008, os prêmios recebidos na emissão de debêntures.','2008-01-01',NULL,'A'),(306,'3.01.01.05.01.10.20','Doações e Subvenções para Investimentos','Contas que registram, a partir de 01.01.2008, as doações e subvenções para investimento.','2008-01-01',NULL,'A'),(307,'3.01.01.05.01.10.30','Contrapartida dos Ajustes ao Valor Presente','Contrapartida do ajuste ao valor presente dos elementos do ativo e do passivo (art. 183, inciso VIII, e art. 184, inciso III da Lei 6.404/76)','2008-01-01',NULL,'A'),(308,'3.01.01.05.01.10.40','Contrapartida de outros Ajustes às Normas Internacionais de Contabilidade','Contrapartida de outros ajustes decorrentes da adequação às Normas Internacionais de Contabilidade','2008-01-01',NULL,'A'),(309,'3.01.01.05.01.11.00','Outras Receitas Operacionais','Contas que registram todas as demais receitas que, por definição legal, sejam consideradas operacionais, tais como: a) aluguéis de bens por empresa que não tenha por objeto a locação de móveis e imóveis; b) recuperações de despesas operacionais de períodos de apuração anteriores, tais como: prêmios de seguros, importâncias levantadas das contas vinculadas do FGTS, ressarcimento de desfalques, roubos e furtos, etc. As recuperações de custos e despesas no decurso do próprio período de apuração devem ser creditadas diretamente às contas de resultado em que foram debitadas; c) os créditos presumidos do IPI para ressarcimento do valor da Contribuição ao PIS/Pasep e Cofins; d) multas ou vantagens a título de indenização em virtude de rescisão contratual (Lei nº 9.430, de 1996, art. 70, § 3º, II); e) o crédito presumido da contribuição para o PIS/Pasep e da Cofins concedido na forma do art. 3º da Lei nº 10.147, de 2000.',NULL,NULL,'A'),(310,'3.01.01.07','DESPESAS OPERACIONAIS','',NULL,NULL,'S'),(311,'3.01.01.07.01','DESPESAS OPERACIONAIS DAS ATIVIDADES EM GERAL','',NULL,NULL,'S'),(312,'3.01.01.07.01.01.00','Remuneração a Dirigentes e a Conselho de Administração','Contas que registram a despesa incorrida relativa à remuneração mensal e fixa atribuída ao titular de firma individual, aos sócios, diretores e administradores de sociedades, ou aos representantes legais de sociedades estrangeiras, as despesas incorridas com os salários indiretos concedidos pela empresa a administradores, diretores, gerentes e seus assessores (PN Cosit nº 11, de 1992), e o valor referente às remunerações atribuídas aos membros do conselho fiscal/administração/consultivo.',NULL,NULL,'A'),(313,'3.01.01.07.01.02.00','Ordenados, Salários, Gratificações e Outras Remunerações a Empregados','Contas que registram as despesas com ordenados, salários, gratificações e outras despesas com empregados, tais como: comissões, moradia, seguro de vida, contribuições pagas ao plano PAIT, despesas com programa de previdência privada, contribuições para os Fundos de Aposentadoria Programada Individual (Fapi), e outras de caráter remuneratório. Atenção: 1) As despesas correspondentes a salários, ordenados, gratificações e outras remunerações referentes à área de saúde, tais como assistência médica, odontológica e farmacêutica, devem ser indicadas na conta Assistência Médica, Odontológica e Farmacêutica a Empregados. 2) Não deve ser informado nesta conta o valor referente às participações dos empregados no lucro da pessoa jurídica. Esse valor deve ser informado na conta Participações de Empregados.',NULL,'0000-00-00','A'),(314,'3.01.01.07.01.02.01','Ordenados, Salários Gratificações e Outras Remunerações a Empregados','Contas que registram as despesas com ordenados, salários, gratificações e outras despesas com empregados, tais como: comissões, moradia, seguro de vida e outras de caráter remuneratório. Atenção: 1) As despesas correspondentes a salários, ordenados, gratificações e outras remunerações referentes à área de saúde, tais como assistência médica, odontológica e farmacêutica, devem ser indicadas na conta específica. 2) Não deve ser informado nesta conta o valor referente às participações dos empregados no lucro da pessoa jurídica. Esse valor deve ser informado na conta Participações de Empregados.','2008-01-01',NULL,'A'),(315,'3.01.01.07.01.02.03','Planos de Poupança e Investimentos de Empregados','Contas que registram o valor total dos gastos efetuados com Planos de Poupança e Investimentos (PAIT).','2008-01-01',NULL,'A'),(316,'3.01.01.07.01.02.05','Fundo de Aposentadoria Programada Individual de Empregados','Contas que registram o valor total dos gastos efetuados com Fundos de Aposentadoria Programada Individual (FAPI).','2008-01-01',NULL,'A'),(317,'3.01.01.07.01.02.07','Plano de Previdência Privada de Empregados','Contas que registram o valor total dos gastos efetuados com Planos de Previdência Privada.','2008-01-01',NULL,'A'),(318,'3.01.01.07.01.02.09','Outros Gastos com Pessoal','Contas que registram os gastos com empregados não enquadrados nas contas precedentes Atenção: 1) As despesas correspondentes a salários, ordenados, gratificações e outras remunerações referentes à área de saúde, tais como assistência médica, odontológica e farmacêutica, devem ser indicadas na conta  Assistência Médica, Odontológica e Farmacêutica a Empregados; 2) não deve ser informado nesta conta o valor referente às participações dos empregados no lucro da pessoa jurídica. Esse valor deve ser informado na conta Participações de Empregados.','2008-01-01',NULL,'A'),(319,'3.01.01.07.01.03.00','Prestação de Serviços por Pessoa Física sem Vínculo Empregatício','Contas que registram, salvo se houver conta mais específica, as despesas correspondentes aos serviços prestados por pessoa física que não tenha vínculo empregatício com a pessoa jurídica, tais como: comissões, corretagens, gratificações, honorários, direitos autorais e outras remunerações, inclusive as relativas a empreitadas de obras exclusivamente de trabalho e as decorrentes de fretes e carretos em geral.',NULL,NULL,'A'),(320,'3.01.01.07.01.04.00','Prestação de Serviço Pessoa Jurídica','Contas que registram, salvo se houver conta mais específica, o valor das despesas correspondentes aos serviços prestados por outra pessoa jurídica à pessoa jurídica declarante.',NULL,NULL,'A'),(321,'3.01.01.07.01.04.01','Serviços Prestados por Cooperativa de Trabalho','Contas que registram os serviços prestados por cooperativa de trabalho','2008-01-01',NULL,'A'),(322,'3.01.01.07.01.04.02','Locação de Mão-de-obra','Contas que registram o valor total dos gastos efetuados no período com a contratação de serviços executados mediante cessão de mão-de-obra ou empreitada, inclusive em regime temporário, sujeitos à retenção de contribuição previdenciária, nos termos do art. 219 do Regulamento da Previdência Social - RPS, aprovado pelo Decreto nº 3.048, de 1999','2008-01-01',NULL,'A'),(323,'3.01.01.07.01.05.00','Encargos Sociais – Previdência Social','Contas que registram as contribuições para a Previdência Social, não computadas nos custos (inclusive dos dirigentes – PN CST no 35, de 31 de agosto de 1981).',NULL,NULL,'A'),(324,'3.01.01.07.01.06.00','Encargos Sociais – FGTS','Contas que registram as contribuições para a o FGTS, não computadas nos custos (inclusive dos dirigentes - PN CST no 35, de 31 de agosto de 1981).',NULL,NULL,'A'),(325,'3.01.01.07.01.07.00','Encargos Sociais – Outros','Contas que registram os demais encargos sociais, não computados nos custos ou nas contas Encargos Sociais - Previdência Social ou Encargos Sociais - FGTS',NULL,NULL,'A'),(326,'3.01.01.07.01.08.00','Doações e Patrocínios de Caráter Cultural e Artístico (Lei no 8.313/1991)','Contas que registram as doações e patrocínios efetuados no período de apuração em favor de projetos culturais previamente aprovados pelo Ministério da Cultura ou pela Agência Nacional do Cinema (Ancine), observada a legislação de concessão dos projetos.',NULL,NULL,'A'),(327,'3.01.01.07.01.09.00','Doações a Instituições de Ensino e Pesquisa (Lei nº 9.249/1995, art.13, § 2º)','Contas que registram as doações a instituições de ensino e pesquisa cuja criação tenha sido autorizada por lei federal e que preencham os requisitos dos incisos I e II do art. 213 da Constituição Federal, de 1988, que são: a) comprovação de finalidade não-lucrativa e aplicação dos excedentes financeiros em educação; b) assegurar a destinação do seu patrimônio a outra escola comunitária, filantrópica ou confessional, ou ao Poder Público, no caso de encerramento de suas atividades.',NULL,NULL,'A'),(328,'3.01.01.07.01.10.00','Doações a Entidades Civis','Contas que registram as doações efetuadas a: a) entidades civis, legalmente constituídas no Brasil, sem fins lucrativos, que prestem serviços gratuitos em benefício de empregados da pessoa jurídica doadora, e respectivos dependentes, ou em benefício da comunidade na qual atuem; e b) Organizações da Sociedade Civil de Interesse Público (OSCIP), qualificadas segundo as normas estabelecidas na Lei no 9.790, de 23 de março de 1999.',NULL,NULL,'A'),(329,'3.01.01.07.01.11.00','Outras Contribuições e Doações','Contas que registram as doações feitas, entre outras, aos Fundos controlados pelos Conselhos Municipais, Estaduais e Nacional dos Direitos da Criança e do Adolescente.',NULL,NULL,'A'),(330,'3.01.01.07.01.12.00','Alimentação do Trabalhador','Contas que registram as despesas com alimentação do pessoal não ligado à produção, realizadas durante o período de apuração, ainda que a pessoa jurídica não tenha Programa de Alimentação do Trabalhador aprovado pelo Ministério do Trabalho.',NULL,NULL,'A'),(331,'3.01.01.07.01.13.00','PIS/Pasep','Contas que registram as Contribuições para o PIS/Pasep incidente sobre as demais receitas operacionais.',NULL,NULL,'A'),(332,'3.01.01.07.01.14.00','Cofins','Contas que registram a parcela da Cofins incidente sobre as demais receitas operacionais.',NULL,NULL,'A'),(333,'3.01.01.07.01.15.00','CPMF','Contas que registram a Contribuição Provisória sobre Movimentação ou Transmissão de Valores e de Créditos de Natureza Financeira.',NULL,NULL,'A'),(334,'3.01.01.07.01.16.00','Demais Impostos, Taxas e Contribuições, exceto IR e CSLL','Contas que registram os demais Impostos, Taxas e Contribuições, exceto: a) incorporadas ao custo de bens do ativo permanente; b) correspondentes aos impostos não recuperáveis, incorporados ao custo das matérias-primas, materiais secundários, materiais de embalagem e mercadorias destinadas à revenda; c) correspondentes aos impostos recuperáveis; d) correspondentes aos impostos e contribuições redutores da receita bruta; e) correspondentes às Contribuições para o PIS/Pasep e à Cofins incidentes sobre as demais receitas operacionais, e à CPMF, indicados em contas específicas; f) correspondentes à contribuição social sobre o lucro líquido e ao imposto de renda devidos, que são informados em contas específicas.',NULL,NULL,'A'),(335,'3.01.01.07.01.17.00','Arrendamento Mercantil','Contas que registram as despesas, não computadas nos custos, pagas ou creditadas a título de contraprestação de arrendamento mercantil, decorrentes de contrato celebrado com observância da Lei no 6.099, de 12 de setembro de 1974, com as alterações da Lei no 7.132, de 26 de outubro de 1983, e da Portaria MF no 140, de 1984',NULL,NULL,'A'),(336,'3.01.01.07.01.18.00','Aluguéis','Contas que registram as despesas com aluguéis não decorrentes de arrendamento mercantil.',NULL,NULL,'A'),(337,'3.01.01.07.01.19.00','Despesas com Veículos e de Conservação de Bens e Instalações','Contas que registram as despesas relativas aos bens que não estejam ligados diretamente à produção, as realizadas com reparos que não impliquem aumento superior a um ano da vida útil do bem, prevista no ato de sua aquisição, e as relativas a combustíveis e lubrificantes para veículos.',NULL,NULL,'A'),(338,'3.01.01.07.01.20.00','Propaganda e Publicidade','Contas que registram as despesas com propaganda e publicidade.',NULL,'0000-00-00','A'),(339,'3.01.01.07.01.20.01','Propaganda, Publicidade e Patrocínio (Associações Desportivas que Mantenham Equipe de Futebol Profissional)','Contas que registram as despesas relativas a propaganda publicidade e patrocínio com associações desportivas que mantenham equipe de futebol profissional e possuam registro na Federação de Futebol do respectivo Estado, a título de propaganda, publicidade e patrocínio.','2008-01-01',NULL,'A'),(340,'3.01.01.07.01.20.02','Propaganda, Publicidade e Patrocínio','Contas que registram de propaganda, publicidade, exceto as classificadas na conta precedente','2008-01-01',NULL,'A'),(341,'3.01.01.07.01.21.00','Multas','Contas que registram as despesas com multas.',NULL,NULL,'A'),(342,'3.01.01.07.01.22.00','Encargos de Depreciação e Amortização','Contas que registram apenas os encargos a esses títulos, com bens não aplicados diretamente na produção. Inclui a amortização dos ajustes de variação cambial contabilizada no ativo diferido, relativa à atividade geral da pessoa jurídica.',NULL,NULL,'A'),(343,'3.01.01.07.01.23.00','Perdas em Operações de Crédito','Contas que registram as perdas no recebimento de créditos decorrentes das atividades da pessoa jurídica.',NULL,NULL,'A'),(344,'3.01.01.07.01.24.00','Provisões para Férias e 13o Salário de Empregados','Contas que registram as despesas com a constituição de provisões para: a) pagamento de remuneração correspondente a férias e adicional de férias de empregados, inclusive encargos sociais (Decreto no 3.000, de 1999, art. 337, e PN CST no 7, de 1980); b) o 13o salário, no caso de apuração trimestral do imposto, inclusive encargos sociais (Decreto no 3.000, de 1999, art. 338).',NULL,NULL,'A'),(345,'3.01.01.07.01.25.00','Provisão para Perda de Estoque','Contas que registram as despesas com a constituição de provisão para perda de estoque',NULL,NULL,'A'),(346,'3.01.01.07.01.26.00','Demais Provisões','Contas que registram as despesas com provisões não relacionadas  em contas específicas',NULL,NULL,'A'),(347,'3.01.01.07.01.27.00','Gratificações a Administradores','Contas que registram as gratificações a administradores.',NULL,NULL,'A'),(348,'3.01.01.07.01.28.00','Royalties e Assistência Técnica – PAÍS','Contas que registram as despesas correspondentes às importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no Brasil, a título de royalties e assistência técnica, científica ou assemelhada, que não estejam relacionados com a produção de bens e/ou serviços.',NULL,NULL,'A'),(349,'3.01.01.07.01.29.00','Royalties e Assistência Técnica – EXTERIOR','Contas que registram as despesas correspondentes às importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no exterior, a título de royalties e assistência técnica, científica ou assemelhada, que não estejam relacionados com a produção de bens e/ou serviços.',NULL,NULL,'A'),(350,'3.01.01.07.01.30.00','Assistência Médica, Odontológica e Farmacêutica a Empregados','Indicar o valor das despesas com assistência médica, odontológica e farmacêutica. Atenção: o valor referente à contratação de serviços de profissionais liberais sem vínculo empregatício ou de sociedades civis deve ser informado nas contas Prestação de Serviços por Pessoa Física sem Vínculo Empregatício ou Prestação de Serviço Pessoa Jurídica, conforme o caso.',NULL,NULL,'A'),(351,'3.01.01.07.01.31.00','Pesquisas Científicas e Tecnológicas','Contas que registram as despesas efetuadas a esse título, inclusive a contrapartida das amortizações daquelas registradas no ativo diferido',NULL,NULL,'A'),(352,'3.01.01.07.01.32.00','Bens de Natureza Permanente Deduzidos como Despesa','Contas que registram as despesas com aquisição de bens do ativo imobilizado cujo prazo de vida útil não ultrapasse um ano, ou, caso exceda esse prazo, tenha valor unitário igual ou inferior ao fixado no art. 301 do Decreto no 3.000, de 1999.',NULL,NULL,'A'),(353,'3.01.01.07.01.33.00','Outras Despesas Operacionais','Contas que registram as demais despesas operacionais, cujos títulos não se adaptem à nomenclatura específica desta ficha, tais como: a) contribuição sindical; b) prêmios de seguro; c) fretes e carretos que não componham os custos; d) despesas com viagens, diárias e ajudas de custo; e) transporte de empregados.',NULL,'0000-00-00','A'),(354,'3.01.01.07.01.33.01','Despesas com viagens, diárias e ajusta de custo','Contas que registram as despesas operacionais com viagens, diárias e ajuda de custo','2008-01-01',NULL,'A'),(355,'3.01.01.07.01.33.90','Outras Despesas Operacionais','Contas que registram as demais despesas operacionais, cujos títulos não se adaptem à nomenclatura específica desta ficha, tais como: a) contribuição sindical; b) prêmios de seguro; c) fretes e carretos que não componham os custos; d) transporte de empregados.','2008-01-01',NULL,'A'),(356,'3.01.01.09','OUTRAS DESPESAS OPERACIONAIS','',NULL,NULL,'S'),(357,'3.01.01.09.01','OUTRAS DESPESAS OPERACIONAIS','',NULL,NULL,'S'),(358,'3.01.01.09.01.01.00','(-) Variações Cambiais Passivas','Contas que registram as perdas monetárias passivas resultantes da atualização dos direitos de créditos e das obrigações, calculadas com base nas variações nas taxas de câmbio (Lei no 9.069, de 1995, art.52, e Lei no 9.249, de 1995, art. 8o).Inclusive a variação cambial passiva correspondente: a) à atualização das obrigações e dos créditos em moeda estrangeira, registrada em qualquer data e apurada no encerramento do período de apuração em função da taxa de câmbio vigente; b) às operações com moeda estrangeira e conversão de obrigações para moeda nacional, ou novação dessas obrigações, ou sua extinção, total ou parcial, em virtude de capitalização, dação em pagamento, compensação, ou qualquer outro modo, desde que observadas as condições fixadas pelo Banco Central do Brasil. Atenção: a amortização dos ajustes de variação cambial contabilizada no ativo diferido deve ser informada na conta Encargos de Depreciação e Amortização (Lei no 9.816, de 1999, art. 2o, e Lei no 10.305, de 2001). ',NULL,NULL,'A'),(359,'3.01.01.09.01.02.00','(-) Perdas Incorridas no Mercado de Renda Variável, exceto Day-Trade','Contas que registram: a) o somatório das perdas incorridas, em cada mês do período de apuração, em operações realizadas nas bolsas de valores, de mercadorias, de futuros e assemelhadas, existentes no País; b) as perdas incorridas nas alienações, fora de bolsa, de ouro, ativo financeiro, e de participações societárias, exceto as alienações de participações societárias permanentes em sociedades coligadas e controladas e de participações societárias que permanecerem no ativo da pessoa jurídica até o término do ano-calendário seguinte ao de suas aquisições; e c) as perdas em operações de swap e no resgate de quota de fundo de investimento que mantenha, no mínimo, 67% (sessenta e sete por cento) de ações negociadas no mercado à vista de bolsa de valores ou entidade assemelhada (Lei no 9.532, de 1997, art. 28, alterado pela MP no 1.636, de 1998, art. 2o, e reedições). São consideradas assemelhadas às bolsas de valores, de mercadorias e de futuros as entidades cujo objeto social seja análogo ao das referidas bolsas e que funcionem sob a supervisão e fiscalização da Comissão de Valores Mobiliários (CVM). Atenção: as perdas apuradas em operações day-trade devem ser informadas em conta própria. ',NULL,NULL,'A'),(360,'3.01.01.09.01.03.00','(-) Perdas em Operações Day-Trade','Contas que registram o somatório das perdas diárias apuradas, em cada mês do período de apuração, em operações day-trade.Não se caracteriza como day-trade o exercício da opção e a venda ou compra do ativo no mercado à vista, no mesmo dia.Também não se caracterizam como day-trade as operações iniciadas por intermédio de uma instituição e encerradas em outra, quando houver a liquidação física mediante movimentação de títulos ou valores mobiliários em custódia.',NULL,NULL,'A'),(361,'3.01.01.09.01.04.00','(-) Juros sobre o Capital Próprio','Contas que registram as despesas com juros pagos ou creditados individualizadamente a titular, sócios ou acionistas, a título de remuneração do capital próprio, calculados sobre as contas do patrimônio liquido e limitados à variação, pro rata dia, da Taxa de Juros de Longo Prazo (TJLP) observando-se o regime de competência (Lei no 9.249, de 1995, art. 9o).',NULL,NULL,'A'),(362,'3.01.01.09.01.05.00','(-) Outras Despesas Financeiras','Contas que registram as despesas relativas a juros, não incluídas nas em outras contas, a descontos de títulos de crédito e ao deságio na colocação de debêntures ou outros títulos. Tais despesas serão obrigatoriamente rateadas, segundo o regime de competência. Atenção: 1) as variações monetárias passivas decorrentes da atualização das obrigações, em função de índices ou coeficientes aplicáveis por disposição legal ou contratual, devem ser informadas como despesa financeira; 2) as variações cambiais passivas não devem ser informadas nesta conta, e sim na conta Variações Cambiais Passivas.',NULL,NULL,'A'),(363,'3.01.01.09.01.06.00','(-) Prejuízos na Alienação de Participações Não Integrantes do Ativo Permanente','Contas que registram os prejuízos havidos em virtude de alienação de ações, títulos ou quotas de capital não integrantes do ativo permanente, desde que não incluídos nas contas Perdas Incorridas no Mercado de Renda Variável, exceto Day-Trade ou Perdas em Operações Day-Trade.',NULL,NULL,'A'),(364,'3.01.01.09.01.07.00','(-) Resultados Negativos em Participações Societárias','Contas que registram as perdas por ajustes no valor de investimentos relevantes avaliados pelo método da equivalência patrimonial, decorrentes de prejuízos apurados nas controladas e coligadas. Atenção:considera-se controlada a filial, a agência, a sucursal, a dependência ou o escritório de representação no exterior, sempre que os respectivos ativos e passivos não estejam incluídos na contabilidade da investidora, por força de normatização específica. Devem, também, ser indicados nesta conta os resultados negativos derivados de participações societárias no exterior, avaliadas pelo patrimônio líquido. Incluem-se, nestas informações, as perdas apuradas em filiais, sucursais e agências da pessoa jurídica localizadas no exterior.',NULL,NULL,'A'),(365,'3.01.01.09.01.07.10','(-) Amortização de Ágio nas Aquisições de Investimentos Avaliados pelo Patrimônio Líquido','Contas que registram o valor da amortização registrada no período, referente ao ágio nas aquisições de investimentos avaliados pelo método da equivalência patrimonial. Atenção: O valor amortizado deve ser adicionado ao lucro líquido, para determinação do lucro real, e controlado na Parte B do Livro de Apuração do Lucro Real até a alienação ou baixa da participação societária, quando, então, pode ser excluído do lucro líquido, para determinação do lucro real.','2008-01-01',NULL,'A'),(366,'3.01.01.09.01.08.00','(-) Resultados Negativos em SCP','Conta utilizada pelos sócios ostensivos, pessoas jurídicas, de sociedades em conta de participação, para indicar as perdas por ajustes no valor de participação em SCP, avaliada pelo método da equivalência patrimonial.',NULL,NULL,'A'),(367,'3.01.01.09.01.09.00','(-) Perdas em Operações Realizadas no Exterior','Contas que registram as perdas em operações realizadas no exterior diretamente pela pessoa jurídica domiciliada no Brasil, com exceção das perdas de capital decorrentes da alienação de bens e direitos do ativo permanente situados no exterior, que devem ser indicadas na conta Outras Despesas Não Operacionais.',NULL,NULL,'A'),(368,'3.01.01.09.01.10.00','(-) Contrapartida dos Ajustes ao Valor Presente','Contrapartida do ajuste ao valor presente dos elementos do ativo e do passivo (art. 183, inciso VIII, e art. 184, inciso III da Lei 6.404/76)','2008-01-01',NULL,'A'),(369,'3.01.01.09.01.11.00','(-) Contrapartida de outros Ajustes às Normas Internacionais de Contabilidade','Contrapartida de outros ajustes decorrentes da adequação às Normas Internacionais de Contabilidade',NULL,NULL,'A'),(370,'3.01.01.09.01.12.00','(-) Contrapartida dos Ajustes de Valor do Imobilizado e Intangível','Contrapartida dos ajustes decorrentes da análise de recuperação dos valores registrados no imobilizado e no  intangível (art. 183, § 3º, da Lei 6.404/76)',NULL,NULL,'A'),(371,'3.01.03','OUTRAS RECEITAS E OUTRAS DESPESAS','',NULL,NULL,'S'),(372,'3.01.03.01','RECEITAS E DESPESAS NÃO OPERACIONAIS','',NULL,NULL,'S'),(373,'3.01.03.01.01','RECEITAS NÃO OPERACIONAIS','',NULL,NULL,'S'),(374,'3.01.03.01.01.01.00','Receitas de Alienações de Bens e Direitos do Ativo Permanente','Contas que registram as receitas auferidas por meio de alienações, inclusive por desapropriação, de bens e direitos do ativo permanente. O valor relativo às receitas obtidas pela venda de sucata e de bens ou direitos do ativo permanente baixados em virtude de terem se tornado imprestáveis, obsoletos ou caído em desuso deve ser informado na conta Outras Receitas Não Operacionais Os valores correspondentes ao ganho ou perda de capital decorrente da alienação de bens e direitos do ativo permanente situados no exterior devem ser indicados, pelo seu resultado, nas contas Outras Receitas Não Operacionais ou Outras Despesas Não Operacionais, conforme o caso.',NULL,NULL,'A'),(375,'3.01.03.01.01.01.10','Ganhos de Capital por Variação Percentual em Participação Societária Avaliada pelo Patrimônio Líquido','Contas que registram o ganho de capital resultante de acréscimo, por variação percentual, do valor do patrimônio líquido de investimento avaliado pelo método da equivalência patrimonial. Atenção: Esse valor deve ser excluído do lucro líquido para determinação do lucro real no período de apuração.','2008-01-01',NULL,'A'),(376,'3.01.03.01.01.02.00','Outras Receitas Não Operacionais','Contas que registram: a) todas as demais receitas decorrentes de operações não incluídas nas atividades principais e acessórias da empresa, tais como: a reversão do saldo da provisão para perdas prováveis na realização de investimentos e a reserva de reavaliação realizada no período de apuração, quando computada em conta de resultado; b) os ganhos de capital por variação na percentagem de participação no capital social de coligada ou controlada, quando o investimento for avaliado pela equivalência patrimonial (Decreto no 3.000, de 1999, art. 428); c) os ganhos de capital decorrentes da alienação de bens e direitos do ativo permanente situados no exterior. Devem ser indicadas tanto as contas que registram as receitas quanto as que registram os custos.',NULL,NULL,'A'),(377,'3.01.03.01.03','DESPESAS NÃO OPERACIONAIS','',NULL,NULL,'S'),(378,'3.01.03.01.03.01.00','(-) Valor Contábil dos Bens e Direitos Alienados','Contas que registram o contábil dos bens do ativo permanente baixados no curso do período de apuração cuja receita da venda tenha sido indicada na conta Receitas de Alienações de Bens e Direitos do Ativo Permanente.  O valor contábil de bens ou direitos baixados em virtude de terem se tornado imprestáveis, obsoletos ou caído em desuso e o valor contábil de bens ou direitos situados no exterior devem ser informados na conta Outras Despesas Não Operacionais.',NULL,NULL,'A'),(379,'3.01.03.01.03.01.10','(-) Perdas de Capital por Variação Percentual em Participação Societária Avaliada pelo Patrimônio Líquido','Contas que registram a perda de capital resultante de redução, por variação percentual, do valor do patrimônio líquido de investimento avaliado pelo método da equivalência patrimonial.','2008-01-01',NULL,'A'),(380,'3.01.03.01.03.02.00','(-) Outras Despesas Não Operacionais','Contas que registram: a) o valor contábil dos bens do ativo permanente baixados no curso do período de apuração não incluídos na conta precedente e a despesa com a constituição da provisão para perdas prováveis na realização de investimentos. Atenção: Sobre a definição de valor contábil, consultar o § 1o do art. 418 e o art. 426 do Decreto no 3.000, de 1999. b) as perdas de capital por variação na percentagem de participação no capital social de coligada ou controlada no Brasil, quando o investimento for avaliado pela equivalência patrimonial (Decreto no 3.000, de 1999, art. 428).',NULL,NULL,'A'),(381,'3.01.05','PARTICIPAÇÕES','',NULL,NULL,'S'),(382,'3.01.05.01','PARTICIPAÇÕES NOS LUCROS','',NULL,NULL,'S'),(383,'3.01.05.01.01','PARTICIPAÇÕES DE EMPREGADOS','',NULL,NULL,'S'),(384,'3.01.05.01.01.01.00','(-) Participações de Empregados','Contas que registram as participações atribuídas a empregados segundo disposição legal, estatutária, contratual ou por deliberação da assembléia de acionistas ou sócios.',NULL,NULL,'A'),(385,'3.01.05.01.01.02.00','(-) Contribuições para Assistência ou Previdência de Empregados','Contas que registram as contribuições para instituições ou fundos de assistência ou previdência de empregados, baseadas nos lucros. Não indicar, nesta conta, aquelas contribuições já deduzidas como custo ou despesa operacional.',NULL,NULL,'A'),(386,'3.01.05.01.01.03.00','(-) Outras Participações de Empregados','Contas que registram outras participações de empregados',NULL,NULL,'A'),(387,'3.01.05.01.03','OUTRAS PARTICIPAÇÕES','',NULL,NULL,'S'),(388,'3.01.05.01.03.01.00','(-) Participações de Administradores e Partes Beneficiárias','Contas que registram quaisquer participações nos lucros atribuídas a administradores, sócio, titular de empresa individual e a portadores de partes beneficiárias, durante o período de apuração.',NULL,NULL,'A'),(389,'3.01.05.01.03.02.00','(-) Participações de Debêntures','Contas que representam as participações nos lucros da companhia atribuídas a debêntures de sua emissão',NULL,NULL,'A'),(390,'3.01.05.01.03.03.00','(-) Outras','Contas que registram outras participações',NULL,NULL,'A'),(391,'3.02','PROVISÃO PARA CSLL E IRPJ (ATIVIDADES EM GERAL)','',NULL,NULL,'S'),(392,'3.02.01','PROVISÃO PARA CSLL E IRPJ','',NULL,NULL,'S'),(393,'3.02.01.01','PROVISÃO PARA CSLL E IRPJ','',NULL,NULL,'S'),(394,'3.02.01.01.01','PROVISÃO PARA CSLL E IRPJ','',NULL,NULL,'S'),(395,'3.02.01.01.01.01.00','(-) Contribuição Social sobre o Lucro Líquido','Contas que registram as provisões para a CSLL calculadas sobre a base de cálculo correspondente ao período de apuração e sobre os lucros diferidos da atividade geral, se for o caso. A sua constituição é obrigatória para todas as pessoas jurídicas tributadas com base no lucro real. As cooperativas devem informar, nesta conta, a provisão da CSLL sobre os resultados das operações realizadas com os não-associados. Atenção: para as empresas com atividades mistas, os valores da CSLL relativos às atividades em geral e atividade rural devem ser informados nas contas específicas de cada atividade (\"Atividades em Geral\" e \"Atividade Rural\", respectivamente).',NULL,NULL,'A'),(396,'3.02.01.01.01.02.00','(-) Provisão para Imposto de Renda - Pessoa Jurídica','Contas que registram as provisões para o IRPJ calculadas sobre a base de cálculo correspondente ao período de apuração e sobre os lucros diferidos da atividade geral, se for o caso. A sua constituição é obrigatória para todas as pessoas jurídicas tributadas com base no lucro real. As cooperativas devem informar, nesta conta, a provisão para o IRPJ sobre os resultados das operações realizadas com os não-associados. Atenção: para as empresas com atividades mistas, os valores do IRPJ relativos às atividades em geral e atividade rural devem ser informados nas contas específicas de cada atividade (\"Atividades em Geral\" e \"Atividade Rural\", respectivamente).',NULL,NULL,'A'),(397,'3.05','RESULTADO ANTES DO IRPJ E DA CSLL - ATIVIDADE RURAL','',NULL,NULL,'S'),(398,'3.05.01','RESULTADO OPERACIONAL DA ATIVIDADE RURAL','',NULL,NULL,'S'),(399,'3.05.01.01','RECEITA OPERACIONAL LÍQUIDA DA ATIVIDADE RURAL','',NULL,NULL,'S'),(400,'3.05.01.01.01','RECEITA BRUTA DA ATIVIDADE RURAL','',NULL,NULL,'S'),(401,'3.05.01.01.01.01.00','Receita da Atividade Rural','Contas que registram a receita da atividade rural.',NULL,NULL,'A'),(402,'3.05.01.01.03','DEDUÇÕES DA RECEITA BRUTA','',NULL,NULL,'S'),(403,'3.05.01.01.03.01.00','(-) Vendas Canceladas, Devoluções e Descontos Incondicionais','Contas representativas das vendas canceladas, a devoluções de vendas e a descontos incondicionais concedidos sobre  receitas constantes da conta Receita da Atividade Rural.',NULL,NULL,'A'),(404,'3.05.01.01.03.02.00','(-) ICMS','Contas que registram o total do Imposto Sobre Operações Relativas à Circulação de Mercadorias e Sobre Prestação de Serviços de Transporte Interestadual e Intermunicipal e de Comunicação (ICMS) calculado sobre as receitas das vendas e de serviços constantes da conta Receita da Atividade Rural. Informar o resultado da aplicação das alíquotas sobre as respectivas receitas, e não o montante recolhido, durante o período de apuração, pela pessoa jurídica.O valor referente ao ICMS pago como substituto não deve ser incluído nesta conta.',NULL,NULL,'A'),(405,'3.05.01.01.03.03.00','(-) Cofins','Contas que registram a Cofins apurada sobre a receita de vendas em consonância com a legislação vigente à época da ocorrência dos fatos geradores, incidente sobre as receitas da conta Receita da Atividade Rural. O valor informado deve ser apurado de forma centralizada pelo estabelecimento matriz, quando a pessoa jurídica possuir mais de um estabelecimento (Lei no 9.779, de 1999, art. 15, III).  Não incluir a Cofins incidente sobre as demais receitas operacionais, que deverá ser informada em conta distinta.',NULL,NULL,'A'),(406,'3.05.01.01.03.04.00','(-) PIS/Pasep','Contas que registram as contribuições para o PIS/Pasep apurado sobre a receita de vendas em consonância com a legislação vigente à época da ocorrência dos fatos geradores, incidente sobre as receitas da conta Receita da Atividade Rural. O valor informado deve ser apurado de forma centralizada pelo estabelecimento matriz, quando a pessoa jurídica possuir mais de um estabelecimento (Lei no 9.779, de 1999, art. 15, III). Não incluir o PIS/Pasep incidente sobre as demais receitas operacionais, que deverá ser informada em conta distinta.',NULL,NULL,'A'),(407,'3.05.01.01.03.05.00','(-) ISS','Contas que registram o Imposto sobre Serviço de qualquer Natureza (ISS) relativo às receitas de serviços, conforme legislação específica.',NULL,NULL,'A'),(408,'3.05.01.01.03.06.00','(-) Demais Impostos e Contribuições Incidentes sobre Vendas e Serviços','Contas que registrem os demais impostos e contribuições incidentes sobre as receitas das vendas de que trata a conta Receita da Atividade Rural, que guardem proporcionalidade com o preço e sejam considerados redutores das receitas de vendas.',NULL,NULL,'A'),(409,'3.05.01.03','CUSTO DOS BENS E SERVIÇOS VENDIDOS','',NULL,NULL,'S'),(410,'3.05.01.03.01','CUSTO DOS PRODUTOS DA ATIVIDADE RURAL VENDIDOS','',NULL,NULL,'S'),(411,'3.05.01.03.01.00.00','Custo dos Produtos Vendidos da Atividade Rural','','2008-01-01',NULL,'A'),(412,'3.05.01.03.01.01.01','Estoques Iniciais de Insumos Agropecuários','Contas que registram os estoques de insumos agropecuários existentes no início do período de apuração.',NULL,'0000-00-00','A'),(413,'3.05.01.03.01.01.02','Estoques Iniciais de Produtos Agropecuários Acabados','Contas que registram os estoques de produtos agropecuários acabados existentes no início do período de apuração.',NULL,'0000-00-00','A'),(414,'3.05.01.03.01.01.03','Estoques Iniciais de Produtos Agropecuários em Formação','Contas que registram os estoques de produtos agropecuários em formação existentes no início do período de apuração.',NULL,'0000-00-00','A'),(415,'3.05.01.03.01.02.00','Compras de Insumos Agropecuários à Vista','Contas que registram as aquisições à vista, durante o período de apuração, de insumos agropecuários, no mercado interno e externo, para utilização na formação de produtos agropecuários. Também compõem os valores de compras desses insumos os valores referentes aos custos com transporte e seguro até o estabelecimento do contribuinte, os tributos não recuperáveis devidos na importação e o custo relativo ao desembaraço aduaneiro.',NULL,'0000-00-00','A'),(416,'3.05.01.03.01.03.00','Compras de Insumos Agropecuários a Prazo','Contas que registram as aquisições a prazo, durante o período de apuração, de insumos agropecuários, no mercado interno e externo, para utilização na formação de produtos agropecuários. Também compõem os valores de compras desses insumos, os valores referentes aos custos com transporte e seguro até o estabelecimento do contribuinte, os tributos não recuperáveis devidos na importação e o custo relativo ao desembaraço aduaneiro.',NULL,'0000-00-00','A'),(417,'3.05.01.03.01.04.00','Remuneração a Dirigentes da Produção','Contas que registram: a) a remuneração mensal e fixa dos dirigentes diretamente ligados à produção, pelo valor total do custo incorrido no período de apuração, exceto os encargos sociais (Previdência Social e FGTS) que são informados em conta distinta;b) o valor relativo aos custos incorridos com salários indiretos concedidos pela empresa a administradores, diretores, gerentes e seus assessores, se ligados diretamente à produção (PN Cosit no 11, de 30 de setembro de 1992). Atenção: deve ser incluído nesta conta o valor das gratificações dos dirigentes ligados à produção, inclusive o 13o salário.',NULL,'0000-00-00','A'),(418,'3.05.01.03.01.05.00','Custo do Pessoal Aplicado na Produção','Contas que representem do custo com ordenados, salários e outros custos com empregados ligados à produção da empresa, tais como: seguro de vida, contribuições ao plano PAIT, custos com programa de previdência privada, contribuições para os Fundos de Aposentadoria Programada Individual (Fapi), e outras de caráter remuneratório. Inclusive os custos com supervisão direta, manutenção e guarda das instalações, decorrentes de vínculo empregatício com a pessoa jurídica.',NULL,'0000-00-00','A'),(419,'3.05.01.03.01.06.00','Encargos Sociais - Previdência Social','Contas que registram as contribuições para a Previdência Social, relativas ao pessoal ligado diretamente à produção, inclusive dirigentes.',NULL,'0000-00-00','A'),(420,'3.05.01.03.01.07.00','Encargos Sociais – FGTS','Contas que registram as contribuições para o FGTS, relativas ao pessoal ligado diretamente à produção, inclusive dirigentes.',NULL,'0000-00-00','A'),(421,'3.05.01.03.01.08.00','Encargos Sociais – Outros','Contas que registram encargos sociais, relativos ao pessoal ligado diretamente à produção, não classificados nas contas Encargos Sociais - Previdência Social  e Encargos Sociais - FGTS.',NULL,'0000-00-00','A'),(422,'3.05.01.03.01.09.00','Alimentação do Trabalhador','Contas que registram os custos realizados com alimentação do pessoal ligado diretamente à produção.',NULL,'0000-00-00','A'),(423,'3.05.01.03.01.10.00','Manutenção e Reparo de Bens Aplicados na Produção','Contas que representam somente os custos realizados com reparos que não implicaram aumento superior a um ano da vida útil prevista no ato da aquisição do bem.',NULL,'0000-00-00','A'),(424,'3.05.01.03.01.11.00','Arrendamento Mercantil','Contas que representam o valor do custo incorrido a título de contraprestação de arrendamento mercantil de bens alocados na produção, segundo contratos celebrados com observância da Lei no 6.099, de 12 de setembro de 1974, com as alterações da Lei no 7.132, de 26 de outubro de 1983. Os custos com aluguel de outros bens alocados à produção, mediante contrato diferente do de arrendamento mercantil, devem ser indicados em \"Outros Custos\". Os valores referentes a bens que não sejam intrinsecamente relacionados com a produção devem ser informados na conta Arrendamento Mercantil do grupo DESPESAS OPERACIONAIS DA ATIVIDADE RURAL.',NULL,'0000-00-00','A'),(425,'3.05.01.03.01.12.00','Encargos de Depreciação, Amortização e Exaustão','Contas que registram os encargos a esses títulos com bens aplicados diretamente na produção. Os’ encargos que não forem decorrentes de bens intrinsecamente relacionados com a produção devem ser informados na conta Encargos de Depreciação, Amortização e Exaustão do grupo DESPESAS OPERACIONAIS DA ATIVIDADE RURAL.',NULL,'0000-00-00','A'),(426,'3.05.01.03.01.13.00','Constituição de Provisões','Contas que registram os encargos com a constituição de provisões que devam ser imputados aos custos de produção da empresa no período de apuração.',NULL,'0000-00-00','A'),(427,'3.05.01.03.01.14.00','Serviços Prestados por Pessoa Física sem Vínculo Empregatício','Contas que registram, salvo se houver conta mais específica neste plano referencial, os custos correspondentes aos serviços prestados à pessoa jurídica por pessoa física sem vínculo empregatício, relacionados com a atividade rural da pessoa jurídica.',NULL,'0000-00-00','A'),(428,'3.05.01.03.01.15.00','Serviços Prestados por Pessoa Jurídica','Contas que registram, salvo se houver conta mais específica neste plano referencial, os custos correspondentes aos serviços prestados por pessoa jurídica à pessoa jurídica declarante, relacionados com sua atividade rural.',NULL,'0000-00-00','A'),(429,'3.05.01.03.01.16.00','Royalties e Assistência Técnica – PAÍS','Contas que registram as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no Brasil, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade industrial.',NULL,'0000-00-00','A'),(430,'3.05.01.03.01.17.00','Royalties e Assistência Técnica – EXTERIOR','Contas que registram as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no exterior, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade industrial.',NULL,'0000-00-00','A'),(431,'3.05.01.03.01.18.00','Outros Custos','Contas que representam os demais custos da empresa no processo de produção, para os quais não haja conta mais específica ou cujas classificações contábeis não se adaptem à nomenclatura específica desta ficha, tais como: custo referente ao valor de bens de consumo eventual, as quebras ou perdas de estoque, e as ocorridas na fabricação, no transporte e manuseio.',NULL,'0000-00-00','A'),(432,'3.05.01.03.01.19.01','(-) Estoques Finais de Insumos Agropecuários','Contas que registram os estoques de insumos agropecuários existentes no final do período de apuração.',NULL,'0000-00-00','A'),(433,'3.05.01.03.01.19.02','(-) Estoques Finais de Produtos Agropecuários em Formação','Contas que registram os estoques de produtos agropecuários em formação existentes no final do período de apuração.',NULL,'0000-00-00','A'),(434,'3.05.01.03.01.19.03','(-) Estoques Finais de Produtos Agropecuários Acabados','Contas que registram os estoques de produtos agropecuários acabados existentes no final do período de apuração',NULL,'0000-00-00','A'),(435,'3.05.01.03.09','AJUSTES DE ESTOQUES DECORRENTES DE ARBITRAMENTO','',NULL,NULL,'S'),(436,'3.05.01.03.09.01.00','Ajustes de Estoques Decorrentes de Arbitramento','Contas que, na pessoa jurídica submetida à apuração anual do imposto e que teve seu lucro arbitrado em um ou mais trimestres do ano-calendário, representam o valor, positivo ou negativo, correspondente à diferença entre os estoques iniciais do período imediatamente subseqüente ao arbitramento e os estoques finais do período imediatamente anterior ao arbitramento. Caso haja arbitramento em mais de um trimestre do ano-calendário, não consecutivos, as contas devem representar a soma algébrica das diferenças apuradas em relação a cada período arbitrado.',NULL,'0000-00-00','A'),(437,'3.05.01.05','OUTRAS RECEITAS OPERACIONAIS','',NULL,NULL,'S'),(438,'3.05.01.05.01','OUTRAS RECEITAS OPERACIONAIS','',NULL,NULL,'S'),(439,'3.05.01.05.01.01.00','Variações Cambiais Ativas','Contas que registram os ganhos apurados em razão de variações ativas decorrentes da atualização dos direitos de crédito e obrigações, calculados com base nas variações nas taxas de câmbio. Atenção: 1) as variações cambiais ativas decorrentes dos direitos de crédito e de obrigações, em função da taxa de câmbio, são consideradas como receita financeira, inclusive para fins de cálculo do lucro da exploração (Lei no 9.718, art. 9o c/c art. 17); 2) nas atividades de compra e venda, loteamento, incorporação e construção de imóveis, as variações cambiais ativas são reconhecidas como receita segundo as normas constantes da IN SRF no 84/79, de 20 de dezembro de 1979, da IN SRF no 23/83, de 25 de março de 1983, e da IN SRF no 67/88, de 21 de abril de 1988 (IN SRF no 25/99, de 25 de fevereiro de 1999).',NULL,NULL,'A'),(440,'3.05.01.05.01.02.00','Ganhos Auferidos no Mercado de Renda Variável, exceto Day-Trade','Contas que registram: a) o somatório dos ganhos auferidos, em cada mês do período de apuração, em operações realizadas nas bolsas de valores, de mercadorias, de futuros e assemelhadas, existentes no País; b) os ganhos auferidos nas alienações, fora de bolsa, de ouro, ativo financeiro, e de participações societárias, exceto as alienações de participações societárias permanentes em sociedades coligadas e controladas e de participações societárias que permanecerem no ativo da pessoa jurídica até o término do ano-calendário seguinte ao de suas aquisições; e c) os rendimentos auferidos em operações de swap e no resgate de quota de fundo de investimento cujas carteiras sejam constituídas, no mínimo, por 67% (sessenta e sete por cento) de ações no mercado à vista de bolsa de valores ou entidade assemelhada (Lei no 9.532, de 1997, art. 28, alterado pela MP no 1.636, de 1998, art. 2o, e reedições). Considera-se ganho o resultado positivo auferido nas operações citadas acima, realizadas em cada mês, admitida a dedução dos custos e despesas incorridos, necessários à realização das operações. Atenção: 1) os ganhos auferidos em operações day-trade devem ser informados em conta específica; 2) o valor correspondente às perdas incorridas no mercado de renda variável, exceto day-trade, deve ser informado em conta específica. 3) são consideradas assemelhadas às bolsas de valores, de mercadorias e de futuros as entidades cujo objeto social seja análogo ao das referidas bolsas e que funcionem sob a supervisão e fiscalização da Comissão de Valores Mobiliários (CVM).',NULL,NULL,'A'),(441,'3.05.01.05.01.03.00','Ganhos em Operações Day-Trade','Contas que registram os ganhos diários auferidos, em cada mês do período de apuração, em operações day-trade. Considera-se ganho o resultado positivo auferido nas operações citadas acima, realizadas em cada mês, admitida a dedução dos custos e despesas incorridos, necessários à realização das operações. Não se caracteriza como day-trade o exercício da opção e a venda ou compra do ativo no mercado à vista, no mesmo dia. Também não se caracterizam como day-trade as operações iniciadas por intermédio de uma instituição e encerradas em outra, quando houver a liquidação física mediante movimentação de títulos ou valores mobiliários em custódia. Atenção: o valor correspondente às perdas incorridas nas operações day-trade deve ser informado em conta específica.',NULL,NULL,'A'),(442,'3.05.01.05.01.04.00','Receitas de Juros sobre o Capital Próprio','Contas que registram os juros recebidos, a título de remuneração do capital próprio, em conformidade com o art. 9o da Lei no 9.249, de 1995. O valor  informado deve corresponder ao total dos juros recebidos antes do desconto do imposto de renda na fonte. O valor do imposto de renda retido na fonte, para as pessoas jurídicas tributadas pelo lucro real, é considerado antecipação do imposto devido no encerramento do período de apuração ou, ainda, pode ser compensado com aquele que for retido, pela beneficiária, por ocasião do pagamento ou crédito de juros a título de remuneração do capital próprio, ao seu titular ou aos seus sócios.',NULL,NULL,'A'),(443,'','','',NULL,NULL,'A'),(444,'3.05.01.05.01.05.00','Outras Receitas Financeiras','Contas que registram receitas auferidas no período de apuração relativas a juros, descontos, lucro na operação de reporte, prêmio de resgate de títulos ou debêntures e rendimento nominal auferido em aplicações financeiras de renda fixa, não incluídas em contas precedentes deste grupo. As receitas dessa natureza, derivadas de operações com títulos vencíveis após o encerramento do período de apuração, serão rateadas segundo o regime de competência. Atenção: 1) as variações monetárias ativas decorrentes da atualização dos direitos de crédito e das obrigações, em função de índices ou coeficientes aplicáveis por disposição legal ou contratual, devem ser informadas como receita financeira; 2) As variações cambiais ativas devem ser informadas na conta Variações Cambiais Ativas.',NULL,NULL,'A'),(445,'3.05.01.05.01.06.00','Ganhos na Alienação de Participações Não Integrantes do Ativo Permanente','Contas que registram os ganhos auferidos na alienação de ações, títulos ou quotas de capital não integrantes do ativo permanente, desde que não incluídos na conta Ganhos Auferidos no Mercado de Renda Variável, exceto Day-Trade.',NULL,NULL,'A'),(446,'3.05.01.05.01.07.00','Resultados Positivos em Participações Societárias','Contas que registram: a) os lucros e dividendos derivados de investimentos avaliados pelo custo de aquisição; b) os ganhos por ajustes no valor de investimentos relevantes avaliados pelo método da equivalência patrimonial, decorrentes de lucros apurados nas controladas e coligadas; Atenção: considera-se controlada a filial, a agência, a sucursal, a dependência ou o escritório de representação no exterior, sempre que os respectivos ativos e passivos não estejam incluídos na contabilidade da investidora, por força de normatização específica. c) as bonificações recebidas; Atenção: 1) as bonificações recebidas, decorrentes da incorporação de lucros ou reservas não tributados na forma do art. 35 da Lei no 7.713, de 1988, ou apurados nos anos-calendário de 1994 ou 1995, são consideradas a custo zero, não afetando o valor do investimento nem o resultado do período de apuração (art. 3o da Lei no 8.849, de 1994, e art. 3o da Lei no 9.064, de 1995).; 2) no caso de investimento avaliado pelo custo de aquisição, as bonificações recebidas, decorrentes da incorporação de lucros ou reservas tributados na forma do art. 35 da Lei no 7.713, de 1988, e de lucros ou reservas apurados no ano-calendário de 1993 ou a partir do ano-calendário de 1996, são registradas tomando-se como custo o valor da parcela dos lucros ou reservas capitalizados. e) os lucros e dividendos de participações societárias avaliadas pelo custo de aquisição; Atenção:os lucros ou dividendos recebidos em decorrência de participações societárias avaliadas pelo custo de aquisição adquiridas até 6 (seis) meses antes da data do recebimento devem ser registrados como diminuição do valor do custo, não sendo incluídos nesta conta. f) os resultados positivos decorrentes de participações societárias no exterior avaliadas pelo patrimônio líquido, os dividendos de participações avaliadas pelo custo de aquisição e os resultados de equivalência patrimonial relativos a filiais, sucursais ou agências da pessoa jurídica localizadas no exterior, em decorrência de operações realizadas naquelas filiais, sucursais ou agências.Os lucros auferidos no exterior serão adicionados ao lucro líquido, para efeito de determinação do lucro real, no período de apuração correspondente ao balanço levantado em 31 de dezembro do ano-calendário em que tiverem sido disponibilizados, observando-se o disposto nos arts. 394 e 395 do Decreto no 3.000, de 1999, e no art. 74 da Medida Provisória no 2.158-35, de 24 de agosto de 2001.',NULL,NULL,'A'),(447,'3.05.01.05.01.07.10','Amortização de Deságio nas Aquisições de Investimentos Avaliados pelo Patrimônio Líquido','Contas que registram as amortizações de deságios nas aquisições de investimentos avaliados pelo patrimônio líquido. O valor amortizado que for excluído do lucro líquido para determinação do lucro real deve ser controlado na Parte B do Livro de Apuração do Lucro Real até a alienação ou baixa da participação societária, quando, então, deve ser adicionado ao lucro líquido para determinação do lucro real no período de apuração em que for computado o ganho ou perda de capital havido.','2008-01-01',NULL,'A'),(448,'3.05.01.05.01.08.00','Resultados Positivos em SCP','Conta utilizada pelas pessoas jurídicas que forem sócias ostensivas de sociedades em conta de participação, para a registro: a) de lucros derivados de participação em SCP, avaliadas pelo custo de aquisição; b) dos ganhos por ajustes no valor de participação em SCP, avaliadas pelo método da equivalência patrimonial. Atenção:os lucros recebidos de investimento em SCP, avaliado pelo custo de aquisição, ou a contrapartida do ajuste do investimento ao valor do patrimônio líquido da SCP, no caso de investimento avaliado por esse método, podem ser excluídos na determinação do lucro real dos sócios, pessoas jurídicas, das referidas sociedades (Decreto no 3.000, de 1999, art. 149).',NULL,NULL,'A'),(449,'3.05.01.05.01.09.00','Rendimentos e Ganhos de Capital Auferidos no Exterior','Contas que registram os rendimentos e ganhos de capital auferidos no exterior diretamente pela pessoa jurídica domiciliada no Brasil, pelos seus valores antes de descontado o tributo pago no país de origem. Esses valores podem, no caso de apuração trimestral do imposto, ser excluídos na apuração do lucro real do 1o ao 3o trimestres, devendo ser adicionados ao lucro líquido na apuração do lucro real referente ao 4o trimestre. Atenção:Os ganhos de capital referentes a alienações de bens e direitos do ativo permanente situados no exterior devem ser informados na conta Outras Receitas Não Operacionais.',NULL,NULL,'A'),(450,'3.05.01.05.01.10.00','Reversão dos Saldos das Provisões Operacionais','Contas que registram a reversão de  saldos não utilizados das provisões constituídas no balanço do período de apuração imediatamente anterior para fins de apuração do lucro real (Lei no 9.430, de 1996, art. 14).',NULL,NULL,'A'),(451,'3.05.01.05.01.11.00','Outras Receitas Operacionais','Contas que registram todas as demais receitas que, por definição legal, sejam consideradas operacionais, tais como: a) aluguéis de bens por empresa que não tenha por objeto a locação de móveis e imóveis; b) recuperações de despesas operacionais de períodos de apuração anteriores, tais como: prêmios de seguros, importâncias levantadas das contas vinculadas do FGTS, ressarcimento de desfalques, roubos e furtos, etc. As recuperações de custos e despesas no decurso do próprio período de apuração devem ser creditadas diretamente às contas de resultado em que foram debitadas; c) os créditos presumidos do IPI para ressarcimento do valor da Contribuição ao PIS/Pasep e Cofins; d) multas ou vantagens a título de indenização em virtude de rescisão contratual (Lei no 9.430, de 1996, art. 70, § 3o, II);e) o crédito presumido da contribuição para o PIS/Pasep e da Cofins concedido na forma do art. 3o da Lei no 10.147, de 2000.',NULL,NULL,'A'),(452,'3.05.01.05.01.12.00','Prêmios Recebidos na Emissão de Debêntures','Contas que registram, a partir de 01.01.2008, os prêmios recebidos na emissão de debêntures.','2008-01-01',NULL,'A'),(453,'3.05.01.05.01.13.00','Doações e Subvenções para Investimentos','Contas que registram, a partir de 01.01.2008, as doações e subvenções para investimento.','2008-01-01',NULL,'A'),(454,'3.05.01.05.01.14.00','Contrapartida dos Ajustes ao Valor Presente','Contrapartida do ajuste ao valor presente dos elementos do ativo e do passivo (art. 183, inciso VIII, e art. 184, inciso III da Lei 6.404/76)','2008-01-01',NULL,'A'),(455,'3.05.01.05.01.15.00','Contrapartida de outros Ajustes às Normas Internacionais de Contabilidade','Contrapartida de outros ajustes decorrentes da adequação às Normas Internacionais de Contabilidade','2008-01-01',NULL,'A'),(456,'3.05.01.07','DESPESAS OPERACIONAIS','',NULL,NULL,'S'),(457,'3.05.01.07.01','DESPESAS OPERACIONAIS DA ATIVIDADE RURAL','',NULL,NULL,'S'),(458,'3.05.01.07.01.01.00','Remuneração a Dirigentes e a Conselho de Administração','Contas que registram a despesa incorrida relativa à remuneração mensal e fixa atribuída ao titular de firma individual, aos sócios, diretores e administradores de sociedades, ou aos representantes legais de sociedades estrangeiras, as despesas incorridas com os salários indiretos concedidos pela empresa a administradores, diretores, gerentes e seus assessores (PN Cosit no 11, de 1992), e o valor referente às remunerações atribuídas aos membros do conselho fiscal ou consultivo. Atenção: os valores das gratificações aos dirigentes que estejam ligados à área de produção rural devem ser informados na conta Remuneração a Dirigentes da Produção.',NULL,NULL,'A'),(459,'3.05.01.07.01.02.00','Ordenados, Salários, Gratificações e Outras Remunerações a Empregados','Contas que registram a remuneração de empregados, tais como: comissões, moradia, seguro de vida, contribuições pagas ao plano PAIT, despesas com programa de previdência privada, contribuições para os Fundos de Aposentadoria Programada Individual (Fapi), e outras de caráter remuneratório. Atenção: 1) as despesas correspondentes a salários, ordenados, gratificações e outras remunerações referentes à área de saúde, tais como assistência médica, odontológica e farmacêutica, devem ser indicadas na conta Assistência Médica, Odontológica e Farmacêutica a Empregados; 2) não deve ser informado nesta conta o valor referente às participações dos empregados no lucro da pessoa jurídica. Esse valor deve ser informado na conta Participações de Empregados.',NULL,'0000-00-00','A'),(460,'3.05.01.07.01.02.01','Ordenados, Salários Gratificações e Outras Remunerações a Empregados','Contas que registram as despesas com ordenados, salários, gratificações e outras despesas com empregados, tais como: comissões, moradia, seguro de vida e outras de caráter remuneratório. Atenção: 1) As despesas correspondentes a salários, ordenados, gratificações e outras remunerações referentes à área de saúde, tais como assistência médica, odontológica e farmacêutica, devem ser indicadas na conta específica. 2) Não deve ser informado nesta conta o valor referente às participações dos empregados no lucro da pessoa jurídica. Esse valor deve ser informado na conta Participações de Empregados.','2008-01-01',NULL,'A'),(461,'3.05.01.07.01.02.03','Planos de Poupança e Investimentos de Empregados','Contas que registram o valor total dos gastos efetuados com Planos de Poupança e Investimentos (PAIT).','2008-01-01',NULL,'A'),(462,'3.05.01.07.01.02.05','Fundo de Aposentadoria Programada Individual de Empregados','Contas que registram o valor total dos gastos efetuados com Fundos de Aposentadoria Programada Individual (FAPI).','2008-01-01',NULL,'A'),(463,'3.05.01.07.01.02.07','Plano de Previdência Privada de Empregados','Contas que registram o valor total dos gastos efetuados com Planos de Previdência Privada.','2008-01-01',NULL,'A'),(464,'3.05.01.07.01.02.09','Outros Gastos com Pessoal','Contas que registram os gastos com empregados não enquadrados nas contas precedentes Atenção: 1) As despesas correspondentes a salários, ordenados, gratificações e outras remunerações referentes à área de saúde, tais como assistência médica, odontológica e farmacêutica, devem ser indicadas na conta  Assistência Médica, Odontológica e Farmacêutica a Empregados; 2) não deve ser informado nesta conta o valor referente às participações dos empregados no lucro da pessoa jurídica. Esse valor deve ser informado na conta Participações de Empregados.','2008-01-01',NULL,'A'),(465,'3.05.01.07.01.03.00','Prestação de Serviços por Pessoa Física sem Vínculo Empregatício','Contas que registram, salvo se houver conta mais específica, as despesas correspondentes aos serviços prestados por pessoa física que não tenha vínculo empregatício com a pessoa jurídica, tais como: comissões, corretagens, gratificações, honorários, direitos autorais e outras remunerações, inclusive as relativas a empreitadas de obras exclusivamente de trabalho e as decorrentes de fretes e carretos em geral.',NULL,NULL,'A'),(466,'3.05.01.07.01.04.00','Prestação de Serviço Pessoa Jurídica','Contas que registram, salvo se houver conta mais específica, o valor das despesas correspondentes aos serviços prestados por outra pessoa jurídica à pessoa jurídica declarante.',NULL,NULL,'A'),(467,'3.05.01.07.01.04.01','Serviços Prestados por Cooperativa de Trabalho','Contas que registram os serviços prestados por cooperativa de trabalho','2008-01-01',NULL,'A'),(468,'3.05.01.07.01.04.02','Locação de Mão-de-obra','Contas que registram o valor total dos gastos efetuados no período com a contratação de serviços executados mediante cessão de mão-de-obra ou empreitada, inclusive em regime temporário, sujeitos à retenção de contribuição previdenciária, nos termos do art. 219 do Regulamento da Previdência Social - RPS, aprovado pelo Decreto nº 3.048, de 1999','2008-01-01',NULL,'A'),(469,'3.05.01.07.01.05.00','Encargos Sociais - Previdência Social','Contas que registram as contribuições para a Previdência Social, não computadas nos custos (inclusive dos dirigentes - PN CST no 35, de 31 de agosto de 1981).',NULL,NULL,'A'),(470,'3.05.01.07.01.06.00','Encargos Sociais – FGTS','Contas que registram as contribuições para a o FGTS, não computadas nos custos (inclusive dos dirigentes - PN CST no 35, de 31 de agosto de 1981).',NULL,NULL,'A'),(471,'3.05.01.07.01.07.00','Encargos Sociais – Outros','Contas que registram os demais encargos sociais, não computados nos custos ou nas contas Encargos Sociais - Previdência Social ou Encargos Sociais - FGTS',NULL,NULL,'A'),(472,'3.05.01.07.01.08.00','Doações e Patrocínios de Caráter Cultural e Artístico (Lei no 8.313/1991)','Contas que registram as doações e patrocínios efetuados no período de apuração em favor de projetos culturais previamente aprovados pelo Ministério da Cultura ou pela Agência Nacional do Cinema (Ancine), observada a legislação de concessão dos projetos.',NULL,NULL,'A'),(473,'3.05.01.07.01.09.00','Doações a Instituições de Ensino e Pesquisa (Lei no 9.249/1995, art.13, § 2o)','Contas que registram as doações a instituições de ensino e pesquisa cuja criação tenha sido autorizada por lei federal e que preencham os requisitos dos incisos I e II do art. 213 da Constituição Federal, de 1988, que são: a) comprovação de finalidade não-lucrativa e aplicação dos excedentes financeiros em educação; b) assegurar a destinação do seu patrimônio a outra escola comunitária, filantrópica ou confessional, ou ao Poder Público, no caso de encerramento de suas atividades.',NULL,NULL,'A'),(474,'3.05.01.07.01.10.00','Doações a Entidades Civis','Contas que registram as doações efetuadas a: a) entidades civis, legalmente constituídas no Brasil, sem fins lucrativos, que prestem serviços gratuitos em benefício de empregados da pessoa jurídica doadora, e respectivos dependentes, ou em benefício da comunidade na qual atuem; e b) Organizações da Sociedade Civil de Interesse Público (OSCIP), qualificadas segundo as normas estabelecidas na Lei no 9.790, de 23 de março de 1999.',NULL,NULL,'A'),(475,'3.05.01.07.01.11.00','Outras Contribuições e Doações','Contas que registram as doações feitas, entre outras, aos Fundos controlados pelos Conselhos Municipais, Estaduais e Nacional dos Direitos da Criança e do Adolescente.',NULL,NULL,'A'),(476,'3.05.01.07.01.12.00','Alimentação do Trabalhador','Contas que registram as despesas com alimentação do pessoal não ligado à produção, realizadas durante o período de apuração, ainda que a pessoa jurídica não tenha Programa de Alimentação do Trabalhador aprovado pelo Ministério do Trabalho.',NULL,NULL,'A'),(477,'3.05.01.07.01.13.00','PIS/Pasep','Contas que registram as Contribuições para o PIS/Pasep incidente sobre as demais receitas operacionais.',NULL,NULL,'A'),(478,'3.05.01.07.01.14.00','Cofins','Contas que registram a parcela da Cofins incidente sobre as demais receitas operacionais.',NULL,NULL,'A'),(479,'3.05.01.07.01.15.00','CPMF','Contas que registram a Contribuição Provisória sobre Movimentação ou Transmissão de Valores e de Créditos de Natureza Financeira.',NULL,NULL,'A'),(480,'3.05.01.07.01.16.00','Demais Impostos, Taxas e Contribuições, exceto IR e CSLL','Contas que registram os demais Impostos, Taxas e Contribuições, exceto: a) incorporadas ao custo de bens do ativo permanente; b) correspondentes aos impostos não recuperáveis, incorporados ao custo das matérias-primas, materiais secundários, materiais de embalagem e mercadorias destinadas à revenda; c) correspondentes aos impostos recuperáveis; d) correspondentes aos impostos e contribuições redutores da receita bruta ; e) correspondentes às Contribuições para o PIS/Pasep e à Cofins incidentes sobre as demais receitas operacionais, e à CPMF, indicados em contas específicas; f) correspondentes à contribuição social sobre o lucro líquido e ao imposto de renda devidos, que são informados em contas específicas.',NULL,NULL,'A'),(481,'3.05.01.07.01.17.00','Arrendamento Mercantil','Contas que registram as despesas, não computadas nos custos, pagas ou creditadas a título de contraprestação de arrendamento mercantil, decorrentes de contrato celebrado com observância da Lei no 6.099, de 12 de setembro de 1974, com as alterações da Lei no 7.132, de 26 de outubro de 1983, e da Portaria MF no 140, de 1984',NULL,NULL,'A'),(482,'3.05.01.07.01.18.00','Aluguéis','Contas que registram as despesas com aluguéis não decorrentes de arrendamento mercantil.',NULL,NULL,'A'),(483,'3.05.01.07.01.19.00','Despesas com Veículos e de Conservação de Bens e Instalações','Contas que registram as despesas relativas aos bens que não estejam ligados diretamente à produção, as realizadas com reparos que não impliquem aumento superior a um ano da vida útil do bem, prevista no ato de sua aquisição, e as relativas a combustíveis e lubrificantes para veículos.',NULL,NULL,'A'),(484,'3.05.01.07.01.20.00','Propaganda e Publicidade','Contas que registram as despesas com propaganda e publicidade.',NULL,'0000-00-00','A'),(485,'3.05.01.07.01.20.01','Propaganda, Publicidade e Patrocínio (Associações Desportivas que Mantenham Equipe de Futebol Profissional)','Contas que registram as despesas relativas a propaganda publicidade e patrocínio com associações desportivas que mantenham equipe de futebol profissional e possuam registro na Federação de Futebol do respectivo Estado, a título de propaganda, publicidade e patrocínio.','2008-01-01',NULL,'A'),(486,'3.05.01.07.01.20.02','Propaganda, Publicidade e Patrocínio','Contas que registram de propaganda, publicidade, exceto as classificadas na conta precedente','2008-01-01',NULL,'A'),(487,'3.05.01.07.01.21.00','Multas','Contas que registram as despesas com multas.',NULL,NULL,'A'),(488,'3.05.01.07.01.22.00','Encargos de Depreciação e Amortização','Contas que registram apenas os encargos a esses títulos, com bens não aplicados diretamente na produção. Inclui a amortização dos ajustes de variação cambial contabilizada no ativo diferido, relativa à atividade geral da pessoa jurídica.',NULL,NULL,'A'),(489,'3.05.01.07.01.23.00','Perdas em Operações de Crédito','Contas que registram as perdas no recebimento de créditos decorrentes das atividades da pessoa jurídica.',NULL,NULL,'A'),(490,'3.05.01.07.01.24.00','Provisões para Férias e 13o Salário de Empregados','Contas que registram as despesas com a constituição de provisões para: a) pagamento de remuneração correspondente a férias e adicional de férias de empregados, inclusive encargos sociais (Decreto no 3.000, de 1999, art. 337, e PN CST no 7, de 1980); b) o 13o salário, no caso de apuração trimestral do imposto, inclusive encargos sociais (Decreto no 3.000, de 1999, art. 338).',NULL,NULL,'A'),(491,'3.05.01.07.01.25.00','Provisão para Perda de Estoque','Contas que registram as despesas com a constituição de provisão para perda de estoque',NULL,NULL,'A'),(492,'3.05.01.07.01.26.00','Demais Provisões','Contas que registram as despesas com provisões não relacionadas em contas específicas',NULL,NULL,'A'),(493,'3.05.01.07.01.27.00','Gratificações a Administradores','Contas que registram as gratificações a administradores.',NULL,NULL,'A'),(494,'3.05.01.07.01.28.00','Royalties e Assistência Técnica – PAÍS','Contas que registram as despesas correspondentes às importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no Brasil, a título de royalties e assistência técnica, científica ou assemelhada, que não estejam relacionados com a produção.',NULL,NULL,'A'),(495,'3.05.01.07.01.29.00','Royalties e Assistência Técnica – EXTERIOR','Contas que registram as despesas correspondentes às importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no exterior, a título de royalties e assistência técnica, científica ou assemelhada, que não estejam relacionados com a produção.',NULL,NULL,'A'),(496,'3.05.01.07.01.30.00','Assistência Médica, Odontológica e Farmacêutica a Empregados','Indicar o valor das despesas com assistência médica, odontológica e farmacêutica. Atenção: o valor referente à contratação de serviços de profissionais liberais sem vínculo empregatício ou de sociedades civis deve ser informado nas contas Prestação de Serviços por Pessoa Física sem Vínculo Empregatício ou Prestação de Serviço Pessoa Jurídica, conforme o caso.',NULL,NULL,'A'),(497,'3.05.01.07.01.31.00','Pesquisas Científicas e Tecnológicas','Contas que registram as despesas efetuadas a esse título, inclusive a contrapartida das amortizações daquelas registradas no ativo diferido',NULL,NULL,'A'),(498,'3.05.01.07.01.32.00','Bens de Natureza Permanente Deduzidos como Despesa','Contas que registram as despesas com aquisição de bens do ativo imobilizado cujo prazo de vida útil não ultrapasse um ano, ou, caso exceda esse prazo, tenha valor unitário igual ou inferior ao fixado no art. 301 do Decreto no 3.000, de 1999.',NULL,NULL,'A'),(499,'3.05.01.07.01.33.00','Outras Despesas Operacionais','Contas que registram as demais despesas operacionais, cujos títulos não se adaptem à nomenclatura específica desta ficha, tais como: a) contribuição sindical; b) prêmios de seguro; c) fretes e carretos que não componham os custos; d) despesas com viagens, diárias e ajudas de custo; e) transporte de empregados.',NULL,'0000-00-00','A'),(500,'3.05.01.07.01.33.01','Despesas com viagens, diárias e ajusta de custo','Contas que registram as despesas operacionais com viagens, diárias e ajuda de custo','2008-01-01',NULL,'A'),(501,'3.05.01.07.01.33.90','Outras Despesas Operacionais','Contas que registram as demais despesas operacionais, cujos títulos não se adaptem à nomenclatura específica desta ficha, tais como: a) contribuição sindical; b) prêmios de seguro; c) fretes e carretos que não componham os custos; d) transporte de empregados.','2008-01-01',NULL,'A'),(502,'3.05.01.09','OUTRAS DESPESAS OPERACIONAIS','',NULL,NULL,'S'),(503,'3.05.01.09.01','OUTRAS DESPESAS OPERACIONAIS','',NULL,NULL,'S'),(504,'3.05.01.09.01.01.00','(-) Variações Cambiais Passivas','Contas que registram as perdas monetárias passivas resultantes da atualização dos direitos de créditos e das obrigações, calculadas com base nas variações nas taxas de câmbio (Lei no 9.069, de 1995, art. 52, e Lei no 9.249, de 1995, art. 8o).Inclusive a variação cambial passiva correspondente: a) à atualização das obrigações e dos créditos em moeda estrangeira, registrada em qualquer data e apurada no encerramento do período de apuração em função da taxa de câmbio vigente; b) às operações com moeda estrangeira e conversão de obrigações para moeda nacional, ou novação dessas obrigações, ou sua extinção, total ou parcial, em virtude de capitalização,dação em pagamento, compensação, ou qualquer outro modo, desde que observadas as condições fixadas pelo Banco Central do Brasil. Atenção: a amortização dos ajustes de variação cambial contabilizada no ativo diferido deve ser informada na conta Encargos de Depreciação e Amortização (Lei no 9.816, de 1999, art. 2o, e Lei no 10.305, de 2001).',NULL,NULL,'A'),(505,'3.05.01.09.01.02.00','(-) Perdas Incorridas no Mercado de Renda Variável, exceto Day-Trade','Contas que registram: a) o somatório das perdas incorridas, em cada mês do período de apuração, em operações realizadas nas bolsas de valores, de mercadorias, de futuros e assemelhadas, existentes no País; b) as perdas incorridas nas alienações, fora de bolsa, de ouro, ativo financeiro, e de participações societárias, exceto as alienações de participações societárias permanentes em sociedades coligadas e controladas e de participações societárias que permanecerem no ativo da pessoa jurídica até o término do ano-calendário seguinte ao de suas aquisições; e c) as perdas em operações de swap e no resgate de quota de fundo de investimento que mantenha, no mínimo, 67% (sessenta e sete por cento) de ações negociadas no mercado à vista de bolsa de valores ou entidade assemelhada (Lei no 9.532, de 1997, art. 28, alterado pela MP no 1.636, de 1998, art. 2o, e reedições). São consideradas assemelhadas às bolsas de valores, de mercadorias e de futuros as entidades cujo objeto social seja análogo ao das referidas bolsas e que funcionem sob a supervisão e fiscalização da Comissão de Valores Mobiliários (CVM). Devem, também, ser indicados nesta conta os resultados negativos derivados de participações societárias no exterior, avaliadas pelo patrimônio líquido. Incluem-se, nestas informações, as perdas apuradas em filiais, sucursais e agências da pessoa jurídica localizadas no exterior.',NULL,NULL,'A'),(506,'3.05.01.09.01.03.00','(-) Perdas em Operações Day-Trade','Contas que registram o somatório das perdas diárias apuradas, em cada mês do período de apuração, em operações day-trade.Não se caracteriza como day-trade o exercício da opção e a venda ou compra do ativo no mercado à vista, no mesmo dia.Também não se caracterizam como day-trade as operações iniciadas por intermédio de uma instituição e encerradas em outra, quando houver a liquidação física mediante movimentação de títulos ou valores mobiliários em custódia.',NULL,NULL,'A'),(507,'3.05.01.09.01.04.00','(-) Juros sobre o Capital Próprio','Contas que registram as despesas com juros pagos ou creditados individualizadamente a titular, sócios ou acionistas, a título de remuneração do capital próprio, calculados sobre as contas do patrimônio líquido e limitados à variação, pro rata dia, da Taxa de Juros de Longo Prazo (TJLP), observando-se o regime de competência (Lei no 9.249, de 1995, art. 9o).',NULL,NULL,'A'),(508,'3.05.01.09.01.05.00','(-) Outras Despesas Financeiras','Contas que registram as despesas relativas a juros, não incluídas nas em outras contas, a descontos de títulos de crédito e ao deságio na colocação de debêntures ou outros títulos. Tais despesas serão obrigatoriamente rateadas, segundo o regime de competência. Atenção: 1) as variações monetárias passivas decorrentes da atualização das obrigações, em função de índices ou coeficientes aplicáveis por disposição legal ou contratual, devem ser informadas como despesa financeira. 2) As variações cambiais passivas não devem ser informadas nesta conta, e sim na conta Variações Cambiais Passivas.',NULL,NULL,'A'),(509,'3.05.01.09.01.06.00','(-) Prejuízos na Alienação de Participações Não Integrantes do Ativo Permanente','Contas que registram os prejuízos havidos em virtude de alienação de ações, títulos ou quotas de capital não integrantes do ativo permanente, desde que não incluídos nas contas Perdas Incorridas no Mercado de Renda Variável, exceto Day-Trade ou Perdas em Operações Day-Trade.',NULL,NULL,'A'),(510,'3.05.01.09.01.07.00','(-) Resultados Negativos em Participações Societárias','Contas que registram as perdas por ajustes no valor de investimentos relevantes avaliados pelo método da equivalência patrimonial, decorrentes de prejuízos apurados nas controladas e coligadas. Atenção: considera-se controlada a filial, a agência, a sucursal, a dependência ou o escritório de representação no exterior, sempre que os respectivos ativos e passivos não estejam incluídos na contabilidade da investidora, por força de normatização específica. Devem, também, ser indicados nesta conta os resultados negativos derivados de participações societárias no exterior, avaliadas pelo patrimônio líquido. Incluem-se, nestas informações, as perdas apuradas em filiais, sucursais e agências da pessoa jurídica localizadas no exterior.',NULL,NULL,'A'),(511,'3.05.01.09.01.07.10','(-) Amortização de Ágio nas Aquisições de Investimentos Avaliados pelo Patrimônio Líquido','Contas que registram o valor da amortização registrada no período, referente ao ágio nas aquisições de investimentos avaliados pelo método da equivalência patrimonial.','2008-01-01',NULL,'A'),(512,'','','Atenção: O valor amortizado deve ser adicionado ao lucro líquido, para determinação do lucro real, e controlado na Parte B do Livro de Apuração do Lucro Real até a alienação ou baixa da participação societária, quando, então, pode ser excluído do lucro líquido, para determinação do lucro real.',NULL,NULL,''),(513,'3.05.01.09.01.08.00','(-) Resultados Negativos em SCP','Conta utilizada pelos sócios ostensivos, pessoas jurídicas, de sociedades em conta de participação, para indicar as perdas por ajustes no valor de participação em SCP, avaliada pelo método da equivalência patrimonial.',NULL,NULL,'A'),(514,'3.05.01.09.01.09.00','(-) Perdas em Operações Realizadas no Exterior','Contas que registram as perdas em operações realizadas no exterior diretamente pela pessoa jurídica domiciliada no Brasil, com exceção das perdas de capital decorrentes da alienação de bens e direitos do ativo permanente situados no exterior, que devem ser indicadas na conta Outras Despesas Não Operacionais.',NULL,NULL,'A'),(515,'3.05.01.09.01.10.00','(-) Contrapartida dos Ajustes ao Valor Presente','Contrapartida do ajuste ao valor presente dos elementos do ativo e do passivo (art. 183, inciso VIII, e art. 184, inciso III da Lei 6.404/76)','2008-01-01',NULL,'A'),(516,'3.05.01.09.01.11.00','(-) Contrapartida de outros Ajustes às Normas Internacionais de Contabilidade','Contrapartida de outros ajustes decorrentes da adequação às Normas Internacionais de Contabilidade','2008-01-01',NULL,'A'),(517,'3.05.01.09.01.12.00','(-) Contrapartida dos ajustes de valor do imobilizado e intangível','Contrapartida dos ajustes decorrentes da análise de recuperação dos valores registrados no imobilizado e no  intangível (art. 183, § 3º, da Lei 6.404/76)',NULL,NULL,'A'),(518,'3.05.03','PARTICIPAÇÕES','',NULL,NULL,'S'),(519,'3.05.03.01','PARTICIPAÇÕES NOS LUCROS','',NULL,NULL,'S'),(520,'3.05.03.01.01','PARTICIPAÇÕES DE EMPREGADOS','',NULL,NULL,'S'),(521,'3.05.03.01.01.01.00','(-) Participações de Empregados','Contas que registram as participações atribuídas a empregados segundo disposição legal, estatutária, contratual ou por deliberação da assembléia de acionistas ou sócios.',NULL,NULL,'A'),(522,'3.05.03.01.01.02.00','(-) Contribuições para Assistência ou Previdência de Empregados','Contas que registram as contribuições para instituições ou fundos de assistência ou previdência de empregados, baseadas nos lucros. Não indicar, nesta conta, aquelas contribuições já deduzidas como custo ou despesa operacional.',NULL,NULL,'A'),(523,'3.05.03.01.01.03.00','(-) Outras Participações de Empregados','Contas que registram outras participações de empregados',NULL,NULL,'A'),(524,'3.05.03.01.03','OUTRAS PARTICIPAÇÕES','',NULL,NULL,'S'),(525,'3.05.03.01.03.01.00','(-) Participações de Administradores e Partes Beneficiárias','Contas que registram quaisquer participações nos lucros atribuídas a administradores, sócio, titular de empresa individual e a portadores de partes beneficiárias, durante o período de apuração.',NULL,NULL,'A'),(526,'3.05.03.01.03.02.00','(-) Participações de Debêntures','Contas que representam as participações nos lucros da companhia atribuídas a debêntures de sua emissão',NULL,NULL,'A'),(527,'3.05.03.01.03.05.00','(-) Outras','Contas que registram outras participações',NULL,NULL,'A'),(528,'3.06','PROVISÃO PARA CSLL E IRPJ (ATIVIDADE RURAL)','',NULL,NULL,'S'),(529,'3.06.01','PROVISÃO PARA CSLL E IRPJ','',NULL,NULL,'S'),(530,'3.06.01.01','PROVISÃO PARA CSLL E IRPJ  ','',NULL,NULL,'S'),(531,'3.06.01.01.01','PROVISÃO PARA CSLL E IRPJ  ','',NULL,NULL,'S'),(532,'3.06.01.01.01.01.00','(-) Contribuição Social sobre o Lucro Líquido','Contas que registram as provisões para a CSLL calculadas sobre a base de cálculo correspondente ao período de apuração e sobre os lucros diferidos da atividade rural.',NULL,NULL,'A'),(533,'3.06.01.01.01.02.00','(-) Provisão para Imposto de Renda - Pessoa Jurídica','Contas que registram as provisões para o IRPJ calculadas sobre a base de cálculo correspondente ao período de apuração e sobre os lucros diferidos da atividade rural.',NULL,NULL,'A'),(534,'4','SUPERÁVIT/DÉFICIT LÍQUIDO DO PERÍODO','GRUPO DESTINADO EXCLUSIVAMENTE ÀS SOCIEDADES SIMPLES, SEM FINS LUCRATIVOS',NULL,NULL,'S'),(535,'4.01','RESULTADO OPERACIONAL','',NULL,NULL,'S'),(536,'4.01.01','RECEITA OPERACIONAL LÍQUIDA','',NULL,NULL,'S'),(537,'4.01.01.01','RECEITA BRUTA','',NULL,NULL,'S'),(538,'4.01.01.01.01','RECEITA DE VENDA DE PRODUTOS','',NULL,NULL,'S'),(539,'4.01.01.01.01.01.00','Da atividade de Educação','Contas que registram a receita de venda dos produtos da atividade de educação.',NULL,NULL,'A'),(540,'4.01.01.01.01.02.00','Da atividade de Saúde','Contas que registram a receita de venda dos produtos da atividade de saúde.',NULL,NULL,'A'),(541,'4.01.01.01.01.03.00','Da atividade de Assistência Social','Contas que registram 