,'A'),(755,'5.01.05.19.00','Serviços Prestados Pessoa Jurídica','Contas que registram, salvo se houver conta mais específica neste plano referencial, os custos correspondentes aos serviços prestados por pessoa jurídica, relacionados com atividade industrial da pessoa jurídica declarante.','2008-01-01',NULL,'A'),(756,'5.01.05.20.00','Royalties e Assistência Técnica – PAÍS','Contas que registram  as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no Brasil, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade industrial.','2008-01-01',NULL,'A'),(757,'5.01.05.21.00','Royalties e Assistência Técnica – EXTERIOR','Contas que registram as importâncias pagas a beneficiário pessoa física ou jurídica, residente ou domiciliado no exterior, a título de royalties e assistência técnica, científica ou assemelhada, que estejam relacionadas com a atividade industrial.','2008-01-01',NULL,'A'),(758,'5.01.05.90.00','Outros Custos','Contas que representam os demais custos da empresa no processo de produção, para os quais não haja conta maIs específica ou cujas classificações contábeis não se adaptem à nomenclatura específica, tais como: custo referente ao valor de bens de consumo eventual; as quebras ou perdas de estoque, e as ocorridas na fabricação, no transporte e manuseio.','2008-01-01',NULL,'A');

